essages:allpagesfrom','s:19:\"Seiten anzeigen ab:\";'),('de','messages:allpagesprefix','s:28:\"Seiten anzeigen mit Präfix:\";'),('de','messages:allpagessubmit','s:8:\"Anwenden\";'),('de','messages:allpagesto','s:20:\"Seiten anzeigen bis:\";'),('de','messages:alreadyrolled','s:388:\"Das Zurücksetzen der Änderungen von [[User:$2|$2]] ([[User talk:$2|Diskussion]]{{int:pipe-separator}}[[Special:Contributions/$2|{{int:contribslink}}]]) an [[:$1]] ist gescheitert, da bereits ein anderer Benutzer die Seite geändert hat.\n\nDie letzte Änderung stammt von [[User:$3|$3]] ([[User talk:$3|Diskussion]]{{int:pipe-separator}}[[Special:Contributions/$3|{{int:contribslink}}]]).\";'),('de','messages:ancientpages','s:35:\"Seit längerem unbearbeitete Seiten\";'),('de','messages:ancientpages-summary','s:0:\"\";'),('de','messages:and','s:8:\"&#32;und\";'),('de','messages:anoncontribs','s:9:\"Beiträge\";'),('de','messages:anoneditwarning','s:327:\"<strong>Warnung:</strong> Du bist nicht angemeldet. Deine IP-Adresse wird öffentlich sichtbar, falls du Bearbeitungen durchführst. Sofern du dich <strong>[$1 anmeldest]</strong> oder <strong>[$2 ein Benutzerkonto erstellst]</strong>, werden deine Bearbeitungen zusammen mit anderen Beiträgen deinem Benutzernamen zugeordnet.\";'),('de','messages:anonnotice','s:1:\"-\";'),('de','messages:anononlyblock','s:11:\"nur Anonyme\";'),('de','messages:anonpreviewwarning','s:107:\"\'\'Du bist nicht angemeldet. Beim Speichern wird deine IP-Adresse in der Versionsgeschichte aufgezeichnet.\'\'\";'),('de','messages:anontalk','s:16:\"Diskussionsseite\";'),('de','messages:anontalkpagetext','s:586:\"----\n<em>Diese Seite dient dazu, einem nicht angemeldeten Benutzer Nachrichten zu hinterlassen.</em>\nEs wird seine IP-Adresse zur Identifizierung verwendet.\nIP-Adressen können von mehreren Benutzern gemeinsam verwendet werden.\nWenn du mit den Kommentaren auf dieser Seite nichts anfangen kannst, richten sie sich vermutlich an einen früheren Inhaber deiner IP-Adresse und du kannst sie ignorieren.\nDu kannst dir auch ein [[Special:CreateAccount|Benutzerkonto erstellen]] oder dich [[Special:UserLogin|anmelden]], um künftig Verwechslungen mit anderen anonymen Benutzern zu vermeiden.\";'),('de','messages:anonuser','s:33:\"Anonymer {{SITENAME}}-Benutzer $1\";'),('de','messages:anonusers','s:92:\"{{PLURAL:$2|unangemeldetem|unangemeldeten}} {{SITENAME}}-{{PLURAL:$2|Benutzer|Benutzern}} $1\";'),('de','messages:anonymous','s:77:\"{{PLURAL:$1|Unangemeldeter Benutzer|Unangemeldete Benutzer}} auf {{SITENAME}}\";'),('de','messages:api-credits','s:412:\"API-Entwickler:\n* Roan Kattouw (Hauptentwickler von September 2007 bis 2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Yuri Astrakhan (Autor, Hauptentwickler von September 2006 bis September 2007)\n* Brad Jorsch (Hauptentwickler seit 2013)\n\nBitte sende deine Kommentare, Vorschläge und Fragen an mediawiki-api@lists.wikimedia.org\noder reiche einen Fehlerbericht auf https://phabricator.wikimedia.org/ ein.\";'),('de','messages:api-credits-header','s:12:\"Danksagungen\";'),('de','messages:api-error-badtoken','s:42:\"Interner Fehler: Der Token ist fehlerhaft.\";'),('de','messages:api-error-emptypage','s:53:\"Es ist nicht erlaubt, neue leere Seiten zu erstellen.\";'),('de','messages:api-error-publishfailed','s:79:\"Interner Fehler: Der Server konnte die temporäre Datei nicht veröffentlichen.\";'),('de','messages:api-error-stashfailed','s:68:\"Interner Fehler: Der Server konnte keine temporäre Datei speichern.\";'),('de','messages:api-error-unknown-warning','s:29:\"Unbekannte Warnung: „$1“.\";'),('de','messages:api-error-unknownerror','s:28:\"Unbekannter Fehler: „$1“\";'),('de','messages:api-exception-trace','s:15:\"$1 at $2($3)\n$4\";'),('de','messages:api-feed-error-title','s:11:\"Fehler ($1)\";'),('de','messages:api-format-prettyprint-header','s:469:\"Dies ist die Darstellung des $1-Formats in HTML. HTML ist gut zur Fehlerbehebung geeignet, aber unpassend für die Nutzung durch Anwendungen.\n\nGib den Parameter <var>format</var> an, um das Ausgabeformat zu ändern. Lege <kbd>format=$2</kbd> fest, um die von HTML abweichende Darstellung des $1-Formats zu erhalten.\n\nSiehe auch die [[mw:Special:MyLanguage/API|vollständige Dokumentation der API]] oder die [[Special:ApiHelp/main|API-Hilfe]] für weitere Informationen.\";'),('de','messages:api-format-prettyprint-header-hyperlinked','s:377:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('de','messages:api-format-prettyprint-header-only-html','s:219:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('de','messages:api-format-prettyprint-status','s:60:\"Diese Antwort wird mit dem HTTP-Status $1 $2 zurückgegeben.\";'),('de','messages:api-format-title','s:22:\"MediaWiki-API-Ergebnis\";'),('de','messages:api-help-authmanager-general-usage','s:1251:\"The general procedure to use this module is:\n# Fetch the fields available from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$4</kbd>, and a <kbd>$5</kbd> token from <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Present the fields to the user, and obtain their submission.\n# Post to this module, supplying <var>$1returnurl</var> and any relevant fields.\n# Check the <samp>status</samp> in the response.\n#* If you received <samp>PASS</samp> or <samp>FAIL</samp>, you\'re done. The operation either succeeded or it didn\'t.\n#* If you received <samp>UI</samp>, present the new fields to the user and obtain their submission. Then post to this module with <var>$1continue</var> and the relevant fields set, and repeat step 4.\n#* If you received <samp>REDIRECT</samp>, direct the user to the <samp>redirecttarget</samp> and wait for the return to <var>$1returnurl</var>. Then post to this module with <var>$1continue</var> and any fields passed to the return URL, and repeat step 4.\n#* If you received <samp>RESTART</samp>, that means the authentication worked but we don\'t have a linked user account. You might treat this as <samp>UI</samp> or as <samp>FAIL</samp>.\";'),('de','messages:api-help-authmanagerhelper-additional-params','s:341:\"This module accepts additional parameters depending on the available authentication requests. Use <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> (or a previous response from this module, if applicable) to determine the requests available and the fields that they use.\";'),('de','messages:api-help-authmanagerhelper-continue','s:149:\"This request is a continuation after an earlier <samp>UI</samp> or <samp>REDIRECT</samp> response. Either this or <var>$1returnurl</var> is required.\";'),('de','messages:api-help-authmanagerhelper-mergerequestfields','s:71:\"Merge field information for all authentication requests into one array.\";'),('de','messages:api-help-authmanagerhelper-messageformat','s:53:\"Zu verwendendes Format zur Rückgabe von Nachrichten.\";'),('de','messages:api-help-authmanagerhelper-preservestate','s:65:\"Preserve state from a previous failed login attempt, if possible.\";'),('de','messages:api-help-authmanagerhelper-request','s:191:\"Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),('de','messages:api-help-authmanagerhelper-requests','s:243:\"Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),('de','messages:api-help-authmanagerhelper-returnurl','s:514:\"Return URL for third-party authentication flows, must be absolute. Either this or <var>$1continue</var> is required.\n\nUpon receiving a <samp>REDIRECT</samp> response, you will typically open a browser or web view to the specified <samp>redirecttarget</samp> URL for a third-party authentication flow. When that completes, the third party will send the browser or web view to this URL. You should extract any query or POST parameters from the URL and pass them as a <var>$1continue</var> request to this API module.\";'),('de','messages:api-help-datatypes','s:2409:\"Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nSome parameter types in API requests need further explanation:\n;boolean\n:Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\n;timestamp\n:Timestamps may be specified in several formats. ISO 8601 date and time is recommended. All times are in UTC, any included timezone is ignored.\n:* ISO 8601 date and time, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd> (punctuation and <kbd>Z</kbd> are optional)\n:* ISO 8601 date and time with (ignored) fractional seconds, <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>.<var>00001</var>Z</kbd> (dashes, colons, and <kbd>Z</kbd> are optional)\n:* MediaWiki format, <kbd><var>2001</var><var>01</var><var>15</var><var>14</var><var>56</var><var>00</var></kbd>\n:* Generic numeric format, <kbd><var>2001</var>-<var>01</var>-<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd> (optional timezone of <kbd>GMT</kbd>, <kbd>+<var>##</var></kbd>, or <kbd>-<var>##</var></kbd> is ignored)\n:* EXIF format, <kbd><var>2001</var>:<var>01</var>:<var>15</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:*RFC 2822 format (timezone may be omitted), <kbd><var>Mon</var>, <var>15</var> <var>Jan</var> <var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* RFC 850 format (timezone may be omitted), <kbd><var>Monday</var>, <var>15</var>-<var>Jan</var>-<var>2001</var> <var>14</var>:<var>56</var>:<var>00</var></kbd>\n:* C ctime format, <kbd><var>Mon</var> <var>Jan</var> <var>15</var> <var>14</var>:<var>56</var>:<var>00</var> <var>2001</var></kbd>\n:* Seconds since 1970-01-01T00:00:00Z as a 1 to 13 digit integer (excluding <kbd>0</kbd>)\n:* The string <kbd>now</kbd>\n;alternative multiple-value separator\n:Parameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\";'),('de','messages:api-help-datatypes-header','s:10:\"Datentypen\";'),('de','messages:api-help-examples','s:33:\"{{PLURAL:$1|Beispiel|Beispiele}}:\";'),('de','messages:api-help-fallback-description','s:2:\"$1\";'),('de','messages:api-help-fallback-example','s:2:\"$1\";'),('de','messages:api-help-fallback-parameter','s:2:\"$1\";'),('de','messages:api-help-flag-deprecated','s:26:\"Dieses Modul ist veraltet.\";'),('de','messages:api-help-flag-generator','s:49:\"Dieses Modul kann als Generator verwendet werden.\";'),('de','messages:api-help-flag-internal','s:110:\"<strong>Dieses Modul ist intern oder instabil.</strong> Seine Operationen werden ohne Kenntnisnahme geändert.\";'),('de','messages:api-help-flag-m