geschichte in den Namensraum 100.\";'),('de','messages:apihelp-import-extended-description','s:175:\"Bitte beachte, dass der HTTP-POST-Vorgang als Dateiupload ausgeführt werden muss (z.B. durch multipart/form-data), um eine Datei über den <var>xml</var>-Parameter zu senden.\";'),('de','messages:apihelp-import-param-assignknownusers','s:87:\"Weist Bearbeitungen lokalen Benutzern zu, wo der benannte Benutzer lokal vorhanden ist.\";'),('de','messages:apihelp-import-param-fullhistory','s:100:\"Für Interwiki-Importe: importiere die komplette Versionsgeschichte, nicht nur die aktuelle Version.\";'),('de','messages:apihelp-import-param-interwikipage','s:47:\"Für Interwiki-Importe: zu importierende Seite.\";'),('de','messages:apihelp-import-param-interwikiprefix','s:164:\"Für hochgeladene Importe: Auf unbekannte Benutzernamen anzuwendendes Interwiki-Präfix (und bekannte Benutzer, falls <var>$1assignknownusers</var> festgelegt ist).\";'),('de','messages:apihelp-import-param-interwikisource','s:61:\"Für Interwiki-Importe: Wiki, von dem importiert werden soll.\";'),('de','messages:apihelp-import-param-namespace','s:97:\"In diesen Namensraum importieren. Kann nicht zusammen mit <var>$1rootpage</var> verwendet werden.\";'),('de','messages:apihelp-import-param-rootpage','s:105:\"Als Unterseite dieser Seite importieren. Kann nicht zusammen mit <var>$1namespace</var> verwendet werden.\";'),('de','messages:apihelp-import-param-summary','s:42:\"Importzusammenfassung des Logbucheintrags.\";'),('de','messages:apihelp-import-param-tags','s:118:\"Auf den Eintrag im Import-Logbuch und die Nullversion bei den importierten Seiten anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-import-param-templates','s:68:\"Für Interwiki-Importe: importiere auch alle eingebundenen Vorlagen.\";'),('de','messages:apihelp-import-param-xml','s:23:\"Hochgeladene XML-Datei.\";'),('de','messages:apihelp-import-summary','s:70:\"Importiert eine Seite aus einem anderen Wiki oder von einer XML-Datei.\";'),('de','messages:apihelp-json-param-ascii','s:126:\"If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('de','messages:apihelp-json-param-callback','s:154:\"Falls angegeben, wird die Ausgabe in einen angegebenen Funktionsaufruf eingeschlossen. Aus Sicherheitsgründen sind benutzerspezifische Daten beschränkt.\";'),('de','messages:apihelp-json-param-formatversion','s:251:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Experimental modern format. Details may change!\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('de','messages:apihelp-json-param-utf8','s:208:\"Falls angegeben, kodiert die meisten (aber nicht alle) Nicht-ASCII-Zeichen als UTF-8 anstatt sie mit hexadezimalen Escape-Sequenzen zu ersetzen. Standard, wenn <var>formatversion</var> nicht <kbd>1</kbd> ist.\";'),('de','messages:apihelp-json-summary','s:30:\"Daten im JSON-Format ausgeben.\";'),('de','messages:apihelp-jsonfm-summary','s:55:\"Daten im JSON-Format ausgeben (schöngedruckt in HTML).\";'),('de','messages:apihelp-languagesearch-description','s:45:\"Sucht nach Sprachnamen in beliebiger Schrift.\";'),('de','messages:apihelp-languagesearch-example-1','s:19:\"Sucht nach „Te“\";'),('de','messages:apihelp-languagesearch-example-2','s:23:\"Sucht nach „ഫി“\";'),('de','messages:apihelp-languagesearch-example-3','s:49:\"Sucht nach „ഫി“, erlaubt einen Tippfehler\";'),('de','messages:apihelp-languagesearch-param-search','s:18:\"Such-Zeichenfolge.\";'),('de','messages:apihelp-languagesearch-param-typos','s:59:\"Anzahl der erlaubten Rechtschreibfehler in der Sucheingabe.\";'),('de','messages:apihelp-languagesearch-summary','s:50:\"Sucht nach Sprachnamen in einem beliebigen Skript.\";'),('de','messages:apihelp-link','s:25:\"[[Special:ApiHelp/$1|$2]]\";'),('de','messages:apihelp-linkaccount-example-link','s:67:\"Start the process of linking to an account from <kbd>Example</kbd>.\";'),('de','messages:apihelp-linkaccount-summary','s:79:\"Verbindet ein Benutzerkonto von einem Drittanbieter mit dem aktuellen Benutzer.\";'),('de','messages:apihelp-login-example-gettoken','s:27:\"Ruft einen Anmelde-Token ab\";'),('de','messages:apihelp-login-example-login','s:8:\"Anmelden\";'),('de','messages:apihelp-login-extended-description','s:299:\"Diese Aktion sollte nur in Kombination mit [[Special:BotPasswords]] verwendet werden. Die Verwendung für die Anmeldung beim Hauptkonto ist veraltet und kann ohne Warnung fehlschlagen. Um sich sicher beim Hauptkonto anzumelden, verwende <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:apihelp-login-extended-description-nobotpasswords','s:140:\"This action is deprecated and may fail without warning. To safely log in, use <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('de','messages:apihelp-login-param-domain','s:18:\"Domain (optional).\";'),('de','messages:apihelp-login-param-name','s:13:\"Benutzername.\";'),('de','messages:apihelp-login-param-password','s:9:\"Passwort.\";'),('de','messages:apihelp-login-param-token','s:57:\"Anmeldetoken, den du in der ersten Anfrage erhalten hast.\";'),('de','messages:apihelp-login-summary','s:49:\"Anmelden und Authentifizierungs-Cookies beziehen.\";'),('de','messages:apihelp-logout-example-logout','s:32:\"Meldet den aktuellen Benutzer ab\";'),('de','messages:apihelp-logout-summary','s:41:\"Abmelden und alle Sitzungsdaten löschen.\";'),('de','messages:apihelp-main-extended-description','s:1320:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Dokumentation]]\n* [[mw:Special:MyLanguage/API:FAQ|Häufig gestellte Fragen]]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Mailingliste]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce API-Ankündigungen]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Fehlerberichte und Anfragen]\n</div>\n<strong>Status:</strong> Die MediaWiki-API ist eine ausgereifte und stabile Schnittstelle, die aktiv unterstützt und verbessert wird. Während wir versuchen, dies zu vermeiden, können wir gelegentlich Breaking Changes erforderlich machen. Abonniere die [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ MediaWiki-API-Ankündigungs-Mailingliste] für Mitteilungen zu Aktualisierungen.\n\n<strong>Fehlerhafte Anfragen:</strong> Wenn fehlerhafte Anfragen an die API gesendet werden, wird ein HTTP-Header mit dem Schlüssel „MediaWiki-API-Error“ gesendet. Der Wert des Headers und der Fehlercode werden auf den gleichen Wert gesetzt. Für weitere Informationen siehe [[mw:Special:MyLanguage/API:Errors_and_warnings|API: Fehler und Warnungen]].\n\n<p class=\"mw-apisandbox-link\"><strong>Testen:</strong> Zum einfachen Testen von API-Anfragen, siehe [[Special:ApiSandbox]].</p>\";'),('de','messages:apihelp-main-param-action','s:22:\"Auszuführende Aktion.\";'),('de','messages:apihelp-main-param-assert','s:129:\"Sicherstellen, dass der Benutzer eingeloggt ist, wenn auf <kbd>user</kbd> gesetzt, oder Bot ist, wenn auf <kbd>bot</kbd> gesetzt.\";'),('de','messages:apihelp-main-param-assertuser','s:64:\"Überprüft, ob der aktuelle Benutzer der benannte Benutzer ist.\";'),('de','messages:apihelp-main-param-curtimestamp','s:39:\"Aktuellen Zeitstempel mit zurückgeben.\";'),('de','messages:apihelp-main-param-errorformat','s:393:\"Zu verwendendes Format zur Ausgabe von Warnungen und Fehlertexten.\n; plaintext: Wikitext mit entfernten HTML-Tags und ersetzten Entitäten.\n; wikitext: Ungeparster Wikitext.\n; html: HTML.\n; raw: Nachrichtenschlüssel und Parameter.\n; none: Keine Textausgabe, nur die Fehlercodes.\n; bc: Vor MediaWiki 1.29 verwendetes Format. <var>errorlang</var> und <var>errorsuselocal</var> werden ignoriert.\";'),('de','messages:apihelp-main-param-errorlang','s:336:\"Language to use for warnings and errors. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd> returns a list of language codes, or specify <kbd>content</kbd> to use this wiki\'s content language, or specify <kbd>uselang</kbd> to use the same value as the <var>uselang</var> parameter.\";'),('de','messages:apihelp-main-param-errorsuselocal','s:100:\"Falls angegeben, verwenden Fehlertexte lokalisierte Nachrichten aus dem {{ns:MediaWiki}}-Namensraum.\";'),('de','messages:apihelp-main-param-format','s:19:\"Format der Ausgabe.\";'),('de','messages:apihelp-main-param-maxage','s:118:\"Den <code>max-age</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gecacht.\";'),('de','messages:apihelp-main-param-maxlag','s:557:\"maxlag kann verwendet werden, wenn MediaWiki auf einem datenbankreplizierten Cluster installiert ist. Um weitere Replikationsrückstände zu verhindern, lässt dieser Parameter den Client warten, bis der Replikationsrückstand kleiner als der angegebene Wert (in Sekunden) ist. Bei einem größerem Rückstand wird der Fehlercode <samp>maxlag</samp> zurückgegeben mit einer Nachricht wie <samp>Waiting for $host: $lag seconds lagged</samp>.<br />Siehe [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Handbuch: Maxlag parameter]] für weitere Informationen.\";'),('de','messages:apihelp-main-param-origin','s:1133:\"Beim Zugriff auf die API mit einer Kreuz-Domain-AJAX-Anfrage (CORS) muss dies als entstehende Domäne festgelegt werden. Dies muss in jeder Vorfluganfrage mit eingeschlossen werden und deshalb ein Teil der Anfragen-URI sein (nicht des POST-Körpers).\n\nFür authentifizierte Anfragen muss dies exakt einem der Ursprünge im Header <code>Origin</code> entsprechen, so dass es auf etwas wie <kbd>https://de.wikipedia.org</kbd> oder <kbd>https://meta.wikimedia.org</kbd> festgelegt werden muss. Falls dieser Parameter nicht mit dem Header <code>Origin</code> übereinstimmt, wird eine 403-Antwort zurückgegeben. Falls dieser Parameter mit dem Header <code>Origin</code> übereinstimmt und der Ursprung weißgelistet ist, werden die Header <code>Access-Control-Allow-Origin</code> und <code>Access-Control-Allow-Credentials</code> festgelegt.\n\nGib für nicht authentifizierte Anfragen den Wert <kbd>*</kbd> an. Dies verursacht, dass der Header <code>Access-Control-Allow-Origin</code> festgelegt wird, aber <code>Access-Control-Allow-Credentials</code> wird <code>false</code> sein und alle benutzerspezifischen Daten werden beschränkt.\";'),('de','messages:apihelp-main-param-requestid','s:114:\"Der angegebene Wert wird mit in die Antwort aufgenommen und kann zur Unterscheidung von Anfragen verwendet werden.\";'),('de','messages:apihelp-main-param-responselanginfo','s:102:\"Bezieht die für <var>uselang</var> und <var>errorlang</var> verwendeten Sprachen im Ergebnis mit ein.\";'),('de','messages:apihelp-main-param-servedby','s:47:\"Namen des bearbeitenden Hosts mit zurückgeben.\";'),('de','messages:apihelp-main-param-smaxage','s:121:\"Den <code>s-maxage</code>-HTTP-Cache-Control-Header auf diese Anzahl Sekunden festlegen. Fehler werden niemals gepuffert.\";'),('de','messages:apihelp-main-param-uselang','s:348:\"Zu verwendende Sprache für Nachrichtenübersetzungen. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> mit <kbd>siprop=languages</kbd> gibt eine Liste der Sprachcodes zurück. Gib <kbd>user</kbd> zum Verwenden der aktuellen Benutzerspracheinstellung oder <kbd>content</kbd> an, um die Inhaltssprache des Wikis zu verwenden.\";'),('de','messages:apihelp-main-summary','s:0:\"\";'),('de','messages:apihelp-managetags-example-activate','s:136:\"Aktiviert eine Markierung namens <kbd>spam</kbd> mit der Begründung <kbd>For use in edit patrolling</kbd> (für die Eingangskontrolle).\";'),('de','messages:apihelp-managetags-example-create','s:135:\"Erstellt eine Markierung namens <kbd>spam</kbd> mit der Begründung <kbd>For use in edit patrolling</kbd> (für die Eingangskontrolle).\";'),('de','messages:apihelp-managetags-example-deactivate','s:124:\"Deaktiviert eine Markierung namens <kbd>spam</kbd> mit der Begründung <kbd>No longer required</kbd> (nicht mehr benötigt).\";'),('de','messages:apihelp-managetags-example-delete','s:84:\"Löscht die <kbd>vandlaism</kbd>-Markierung mit der Begründung <kbd>Misspelt</kbd>.\";'),('de','messages:apihelp-managetags-param-ignorewarnings','s:43:\"Warnungen während des Vorgangs ignorieren.\";'),('de','messages:apihelp-managetags-param-operation','s:540:\"Welcher Vorgang soll ausgeführt werden:\n;create:Ein neues Änderungsschlagwort zum manuellen Gebrauch erstellen.\n;delete:Ein Änderungsschlagwort aus der Datenbank entfernen. Einschließlich dem Entfernen des Schlagworts von allen Überarbeitungen, kürzlichen Änderungseinträgen und Logbuch-Einträgen, in denen es genutzt wird.\n;activate:Ein Änderungsschlagwort aktivieren und damit Benutzern erlauben es manuell anzuwenden.\n;deactive:Ein Änderungsschlagwort deaktivieren und damit die manuelle Verwendung durch Benutzer unterbinden.\";'),('de','messages:apihelp-managetags-param-reason','s:96:\"optionale Begründung für das Erstellen, Löschen, Aktivieren oder Deaktivieren der Markierung.\";'),('de','messages:apihelp-managetags-param-tag','s:369:\"Schlagwort zum Erstellen, Löschen, Aktivieren oder Deaktivieren. Zum Erstellen darf das Schlagwort noch nicht vorhanden sein. Zur Löschung muss das Schlagwort vorhanden sein. Zur Aktivierung muss das Schlagwort vorhanden sein, darf aber nicht von einer Erweiterung in Gebrauch sein. Zur Deaktivierung muss das Schlagwort gegenwärtig aktiv und manuell definiert sein.\";'),('de','messages:apihelp-managetags-param-tags','s:87:\"Auf den Eintrag im Markierungs-Verwaltungs-Logbuch anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-managetags-summary','s:58:\"Ermöglicht Verwaltungsaufgaben zu Änderungsmarkierungen.\";'),('de','messages:apihelp-mergehistory-example-merge','s:96:\"Fügt alle Versionen von <kbd>Oldpage</kbd> der Versionsgeschichte von <kbd>Newpage</kbd> hinzu.\";'),('de','messages:apihelp-mergehistory-example-merge-timestamp','s:116:\"Merge the page revisions of <kbd>Oldpage</kbd> dating up to <kbd>2015-12-31T04:37:41Z</kbd> into <kbd>Newpage</kbd>.\";'),('de','messages:apihelp-mergehistory-param-from','s:102:\"Title of the page from which history will be merged. Cannot be used together with <var>$1fromid</var>.\";'),('de','messages:apihelp-mergehistory-param-fromid','s:102:\"Page ID of the page from which history will be merged. Cannot be used together with <var>$1from</var>.\";'),('de','messages:apihelp-mergehistory-param-reason','s:55:\"Grund für die Zusammenführung der Versionsgeschichten\";'),('de','messages:apihelp-mergehistory-param-timestamp','s:208:\"Timestamp up to which revisions will be moved from the source page\'s history to the destination page\'s history. If omitted, the entire page history of the source page will be merged into the destination page.\";'),('de','messages:apihelp-mergehistory-param-to','s:98:\"Title of the page to which history will be merged. Cannot be used together with <var>$1toid</var>.\";'),('de','messages:apihelp-mergehistory-param-toid','s:98:\"Page ID of the page to which history will be merged. Cannot be used together with <var>$1to</var>.\";'),('de','messages:apihelp-mergehistory-summary','s:47:\"Führt Versionsgeschichten von Seiten zusammen.\";'),('de','messages:apihelp-move-example-move','s:96:\"<kbd>Badtitle</kbd> nach <kbd>Goodtitle</kbd> verschieben, ohne eine Weiterleitung zu erstellen.\";'),('de','messages:apihelp-move-param-from','s:96:\"Titel der zu verschiebenden Seite. Kann nicht zusammen mit <var>$1fromid</var> verwendet werden.\";'),('de','messages:apihelp-move-param-fromid','s:102:\"Seitenkennung der zu verschiebenden Seite. Kann nicht zusammen mit <var>$1from</var> verwendet werden.\";'),('de','messages:apihelp-move-param-ignorewarnings','s:26:\"Alle Warnungen ignorieren.\";'),('de','messages:apihelp-move-param-movesubpages','s:40:\"Unterseiten verschieben, falls möglich.\";'),('de','messages:apihelp-move-param-movetalk','s:49:\"Verschiebt die Diskussionsseite, falls vorhanden.\";'),('de','messages:apihelp-move-param-noredirect','s:30:\"Keine Weiterleitung erstellen.\";'),('de','messages:apihelp-move-param-reason','s:27:\"Grund für die Umbenennung.\";'),('de','messages:apihelp-move-param-tags','s:111:\"Auf den Eintrag im Verschiebungs-Logbuch und die Nullversion der Zielseite anzuwendende Änderungsmarkierungen.\";'),('de','messages:apihelp-move-param-to','s:46:\"Titel, zu dem die Seite umbenannt werden soll.\";'),('de','messages:apihelp-move-param-unwatch','s:80:\"Die Seite und die entstandene Weiterleitung von der Beobachtungsliste entfernen.\";'),('de','messages:apihelp-move-param-watch','s:78:\"Die Seite und die entstandene Weiterleitung zur Beobachtungsliste hinzufügen.\";'),('de','messages:apihelp-move-param-watchlist','s:157:\"Die Seite in jedem Fall zur Beobachtungsliste hinzufügen oder davon entfernen, die Voreinstellungen dafür nutzen oder den Beobachtungsstatus nicht ändern.\";'),('de','messages:apihelp-move-summary','s:23:\"Eine Seite verschieben.\";'),('de','messages:apihelp-no-such-module','s:30:\"Modul „$1“ nicht gefunden.\";'),('de','messages:apihelp-none-summary','s:16:\"Nichts ausgeben.\";'),('de','messages:apihelp-opensearch-example-te','s:46:\"Seiten finden, die mit <kbd>Te</kbd> beginnen.\";'),('de','messages:apihelp-opensearch-param-format','s:23:\"Das Format der Ausgabe.\";'),('de','messages:apihelp-opensearch-param-limit','s:45:\"Maximale Anzahl zurückzugebender Ergebnisse.\";'),('de','messages:apihelp-opensearch-param-namespace','s:119:\"Zu durchsuchende Namensräume. Wird ignoriert, falls <var>$1search</var> mit einem gültigen Namensraumpräfix beginnt.\";'),('de','messages:apihelp-opensearch-param-redirects','s:295:\"Wie mit Weiterleitungen umgegangen werden soll:\n;return:Gibt die Weiterleitung selbst zurück.\n;resolve:Gibt die Zielseite zurück. Kann weniger als $1limit Ergebnisse zurückgeben.\nAus Kompatibilitätsgründen ist für $1format=json die Vorgabe \"return\" und \"resolve\" für alle anderen Formate.\";'),('de','messages:apihelp-opensearch-param-search','s:18:\"Such-Zeichenfolge.\";'),('de','messages:apihelp-opensearch-param-suggest','s:135:\"Nichts unternehmen, falls <var>[[mw:Special:MyLanguage/Manual:$wgEnableOpenSearchSuggest|$wgEnableOpenSearchSuggest]]</var> falsch ist.\";'),('de','messages:apihelp-opensearch-param-warningsaserror','s:109:\"Wenn Warnungen mit <kbd>format=json</kbd> auftreten, gib einen API-Fehler zurück, anstatt ihn zu ignorieren.\";'),('de','messages:apihelp-opensearch-summary','s:56:\"Das Wiki mithilfe des OpenSearch-Protokolls durchsuchen.\";'),('de','messages:apihelp-options-example-change','s:67:\"Ändert die Einstellungen <kbd>skin</kbd> und <kbd>hideminor</kbd>.\";'),('de','messages:apihelp-options-example-complex','s:89:\"Setzt alle Einstellungen zurück, dann <kbd>skin</kbd> und <kbd>nickname</kbd> festlegen.\";'),('de','messages:apihelp-options-example-reset','s:32:\"Alle Einstellungen zurücksetzen\";'),('de','messages:apihelp-options-extended-description','s:183:\"Only options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('de','messages:apihelp-options-param-change','s:423:\"Liste von Änderungen, die mit name=wert formatiert sind (z.&nbsp;B. skin=vector). Falls kein Wert angegeben wurde (ohne einem Gleichheitszeichen), z.&nbsp;B. Optionname|AndereOption|…, wird die Option auf ihren Standardwert zurückgesetzt. Falls ein übergebener Wert ein Trennzeichen enthält (<kbd>|</kbd>), verwende den [[Special:ApiHelp/main#main/datatypes|alternativen Mehrfachwerttrenner]] zur korrekten Bedienung.\";'),('de','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),('de','messages:apihelp-options-param-optionvalue','s:74:\"Der Wert für die Option, die durch <var>$1optionname</var> angegeben ist.\";'),('de','messages:apihelp-options-param-reset','s:53:\"Setzt die Einstellungen auf Websitestandards zurück.\";'),('de','messages:apihelp-options-param-resetkinds','s:94:\"Liste von zurückzusetzenden Optionstypen, wenn die <var>$1reset</var>-Option ausgewählt ist.\";'),('de','messages:apihelp-options-summary','s:58:\"Die Voreinstellungen des gegenwärtigen Benutzers ändern.\";'),('de','messages:apihelp-paraminfo-example-1','s:271:\"Zeige Info für <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, und <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('de','messages:apihelp-paraminfo-example-2','s:82:\"Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('de','messages:apihelp-paraminfo-param-formatmodules','s:111:\"Liste von Formatmodulnamen (Wert des Parameters <var>format</var>). Stattdessen <var>$1modules</var> verwenden.\";'),('de','messages:apihelp-paraminfo-param-helpformat','s:31:\"Format der Hilfe-Zeichenfolgen.\";'),('de','messages:apihelp-paraminfo-param-mainmodule','s:109:\"Auch Informationen über die Hauptmodule (top-level) erhalten. Benutze <kbd>$1modules=main</kbd> stattdessen.\";'),('de','messages:apihelp-paraminfo-param-modules','s:245:\"Liste von Modulnamen (Werte der Parameter <var>action</var> und <var>format</var> oder <kbd>main</kbd>). Kann Untermodule mit einem <kbd>+</kbd> oder alle Untermodule mit <kbd>+*</kbd> oder alle Untermodule rekursiv mit <kbd>+**</kbd> bestimmen.\";'),('de','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),('de','messages:apihelp-paraminfo-param-querymodules','s:184:\"Liste von Abfragemodulnamen (Werte von <var>prop</var>-, <var>meta</var>- oder <var>list</var>-Parameter). Benutze <kbd>$1modules=query+foo</kbd> anstatt <kbd>$1querymodules=foo</kbd>.\";'),('de','messages:apihelp-paraminfo-summary','s:39:\"Ruft Informationen über API-Module ab.\";'),('de','messages:apihelp-parse-example-page','s:18:\"Eine Seite parsen.\";'),('de','messages:apihelp-parse-example-summary','s:27:\"Parst eine Zusammenfassung.\";'),('de','messages:apihelp-parse-example-text','s:16:\"Wikitext parsen.\";'),('de','messages:apihelp-parse-example-texttitle','s:54:\"Parst den Wikitext über die Eingabe des Seitentitels.\";'),('de','messages:apihelp-parse-extended-description','s:500:\"See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, <var>$1revid</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('de','messages:apihelp-parse-param-contentformat','s:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),('de','messages:apihelp-parse-param-contentmodel','s:187:\"Inhaltsmodell des eingegebenen Textes. Fall ausgelassen, muss $1title angegeben werden und Standardwert wird das Modell des angegebenen Titels. Ist nur gültig im Zusammenhang mit $1text.\";'),('de','messages:apihelp-parse-param-disableeditsection','s:60:\"Lässt Abschnittsbearbeitungslinks in der Parserausgabe weg.\";'),('de','messages:apihelp-parse-param-disablelimitreport','s:68:\"Omit the limit report (\"NewPP limit report\") from the parser output.\";'),('de','messages:apihelp-parse-param-disablepp','s:52:\"Benutze <var>$1disablelimitreport</var> stattdessen.\";'),('de','messages:apihelp-parse-param-disablestylededuplication','s:59:\"Do not deduplicate inline stylesheets in the parser output.\";'),('de','messages:apihelp-parse-param-disabletidy','s:72:\"Wende keine HTML-Säuberung (z.B. Aufräumen) auf die Parser-Ausgabe an.\";'),('de','messages:apihelp-parse-param-disabletoc','s:44:\"Inhaltsverzeichnis in der Ausgabe weglassen.\";'),('de','messages:apihelp-parse-param-effectivelanglinks','s:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('de','messages:apihelp-parse-param-generatexml','s:106:\"Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),('de','messages:apihelp-parse-param-oldid','s:89:\"Parst den Inhalt dieser Version. Überschreibt <var>$1page</var> und <var>$1pageid</var>.\";'),('de','messages:apihelp-parse-param-onlypst','s:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('de','messages:apihelp-parse-param-page','s:113:\"Parst den Inhalt dieser Seite. Kann nicht zusammen mit <var>$1text</var> und <var>$1title</var> verwendet werden.\";'),('de','messages:apihelp-parse-param-pageid','s:63:\"Parst den Inhalt dieser Seite. Überschreibt <var>$1page</var>.\";'),('de','messages:apihelp-parse-param-preview','s:24:\"Im Vorschaumodus parsen.\";'),('de','messages:apihelp-parse-param-prop','s:43:\"Welche Informationen bezogen werden sollen:\";'),('de','messages:apihelp-parse-param-pst','s:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('de','messages:apihelp-parse-param-redirects','s:104:\"Falls <var>$1page</var> oder <var>$1pageid</var> als eine Weiterleitung festgelegt ist, diese auflösen.\";'),('de','messages:apihelp-parse-param-revid','s:91:\"Versionskennung, für <code><nowiki>{{REVISIONID}}</nowiki></code> und ähnliche Variablen.\";'),('de','messages:apihelp-parse-param-section','s:243:\"Parst nur den Inhalt dieser Abschnittsnummer.\n\nFalls <kbd>new</kbd>, parst <var>$1text</var> und <var>$1sectiontitle</var>, als ob ein neuer Abschnitt der Seite hinzugefügt wird.\n\n<kbd>new</kbd> ist nur erlaubt mit der Angabe <var>text</var>.\";'),('de','messages:apihelp-parse-param-sectionpreview','s:75:\"Im Abschnitt Vorschau-Modus parsen (aktiviert ebenfalls den Vorschau-Modus)\";'),('de','messages:apihelp-parse-param-sectiontitle','s:217:\"Überschrift des neuen Abschnittes, wenn <var>section</var> = <kbd>new</kbd> ist.\n\nAnders als beim Bearbeiten der Seite wird der Parameter nicht durch die <var>summary</var> ersetzt, wenn er weggelassen oder leer ist.\";'),('de','messages:apihelp-parse-param-summary','s:28:\"Zu parsende Zusammenfassung.\";'),('de','messages:apihelp-parse-param-text','s:112:\"Zu parsender Text. <var>$1title</var> oder <var>$1contentmodel</var> verwenden, um das Inhaltsmodell zu steuern.\";'),('de','messages:apihelp-parse-param-title','s:146:\"Titel der Seite, zu der der Text gehört. Falls ausgelassen, muss <var>$1contentmodel</var> angegeben werden und [[API]] wird als Titel verwendet.\";'),('de','messages:apihelp-parse-param-useskin','s:238:\"Wendet die ausgewählte Benutzeroberfläche auf die Parserausgabe an. Kann Auswirkungen auf die folgenden Eigenschaften haben: <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),('de','messages:apihelp-parse-param-wrapoutputclass','s:73:\"Zu verwendende CSS-Klasse, in der die Parserausgabe verpackt werden soll.\";'),('de','messages:apihelp-parse-paramvalue-prop-categories','s:50:\"Gibt die Kategorien im geparsten Wikitext zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:45:\"Gibt die HTML-Version der Kategorien zurück.\";'),('de','messages:apihelp-parse-paramvalue-prop-displaytitle','s:44:\"Ergänzt den Titel des geparsten Wikitextes.\";'),('de','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars',