ently <kbd>2</kbd>), may change without warning.\";'),('de','messages:apihelp-php-summary','s:44:\"Daten im serialisierten PHP-Format ausgeben.\";'),('de','messages:apihelp-phpfm-summary','s:69:\"Daten im serialisierten PHP-Format ausgeben (schöngedruckt in HTML).\";'),('de','messages:apihelp-protect-example-protect','s:19:\"Schützt eine Seite\";'),('de','messages:apihelp-protect-example-unprotect','s:147:\"Entsperrt eine Seite, indem die Einschränkungen durch den Schutz auf <kbd>all</kbd> gestellt werden (z.&nbsp;B. darf jeder die Aktion ausführen).\";'),('de','messages:apihelp-protect-example-unprotect2','s:69:\"Eine Seite entsperren, indem keine Einschränkungen übergeben werden\";'),('de','messages:apihelp-protect-param-cascade','s:189:\"Aktiviert den Kaskadenschutz (d.&nbsp;h. in dieser Seite eingebundene Vorlagen und Bilder werden geschützt). Wird ignoriert, falls keine der angegebenen Schutzebenen Kaskaden unterstützt.\";'),('de','messages:apihelp-protect-param-expiry','s:278:\"Zeitstempel des Schutzablaufs. Wenn nur ein Zeitstempel übergeben wird, ist dieser für alle Seitenschutze gültig. Um eine unendliche Schutzdauer festzulegen, kannst du die Werte <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> oder <kbd>never</kbd> übergeben.\";'),('de','messages:apihelp-protect-param-pageid','s:106:\"Seitenkennung der Seite, die du (ent-)sperren möchtest. Kann nicht zusammen mit $1title verwendet werden.\";'),('de','messages:apihelp-protect-param-protections','s:303:\"Listet die Schutzebenen nach dem Format <kbd>Aktion=Ebene</kbd> (z.&nbsp;B. <kbd>edit=sysop</kbd>) auf. Die Ebene <kbd>all</kbd> bedeutet, dass jeder die Aktion ausführen darf, z.&nbsp;B. keine Beschränkung.\n\n<strong>HINWEIS:</strong> Wenn eine Aktion nicht angegeben wird, wird deren Schutz entfernt.\";'),('de','messages:apihelp-protect-param-reason','s:50:\"Grund für den Seitenschutz oder dessen Aufhebung.\";'),('de','messages:apihelp-protect-param-tags','s:73:\"Auf den Seitenschutz-Logb