vs-param-end','s:50:\"Der Zeitstempel bei dem die Auflistung enden soll.\";'),('de','messages:apihelp-query+deletedrevs-param-excludeuser','s:64:\"Schließe Bearbeitungen dieses Benutzers bei der Auflistung aus.\";'),('de','messages:apihelp-query+deletedrevs-param-from','s:37:\"Auflistung bei diesem Titel beginnen.\";'),('de','messages:apihelp-query+deletedrevs-param-limit','s:52:\"Die maximale Anzahl aufzulistendender Bearbeitungen.\";'),('de','messages:apihelp-query+deletedrevs-param-namespace','s:40:\"Nur Seiten dieses Namensraums auflisten.\";'),('de','messages:apihelp-query+deletedrevs-param-prefix','s:69:\"Suche nach allen Seitentiteln, die mit dem angegebenen Wert beginnen.\";'),('de','messages:apihelp-query+deletedrevs-param-prop','s:628:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the ID of the user who made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('de','messages:apihelp-query+deletedrevs-param-start','s:53:\"Der Zeitstempel bei dem die Auflistung beginnen soll.\";'),('de','messages:apihelp-query+deletedrevs-param-tag','s:66:\"Listet nur Bearbeitungen auf, die die angegebene Markierung haben.\";'),('de','messages:apihelp-query+deletedrevs-param-to','s:36:\"Auflistung bei diesem Titel beenden.\";'),('de','messages:apihelp-query+deletedrevs-param-unique','s:48:\"Listet nur eine Bearbeitung für jede Seite auf.\";'),('de','messages:apihelp-query+deletedrevs-param-user','s:48:\"Liste nur Bearbeitungen von diesem Benutzer auf.\";'),('de'