seite</kbd> abrufen\";'),('de','messages:apihelp-query+links-param-dir','s:24:\"Die Auflistungsrichtung.\";'),('de','messages:apihelp-query+links-param-limit','s:45:\"Wie viele Links zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+links-param-namespace','s:40:\"Zeigt nur Links in diesen Namensräumen.\";'),('de','messages:apihelp-query+links-param-titles','s:101:\"Only list links to these titles. Useful for checking whether a certain page links to a certain title.\";'),('de','messages:apihelp-query+links-summary','s:51:\"Gibt alle Links von den angegebenen Seiten zurück.\";'),('de','messages:apihelp-query+linkshere-example-generator','s:57:\"Get information about pages linking to the [[Main Page]].\";'),('de','messages:apihelp-query+linkshere-example-simple','s:60:\"Holt eine Liste von Seiten, die auf [[Main Page]] verlinken.\";'),('de','messages:apihelp-query+linkshere-param-limit','s:36:\"Wie viel zurückgegeben werden soll.\";'),('de','messages:apihelp-query+linkshere-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('de','messages:apihelp-query+linkshere-param-prop','s:31:\"Zurückzugebende Eigenschaften:\";'),('de','messages:apihelp-query+linkshere-param-show','s:108:\"Show only items that meet these criteria:\n;redirect:Only show redirects.\n;!redirect:Only show non-redirects.\";'),('de','messages:apihelp-query+linkshere-paramvalue-prop-pageid','s:30:\"Die Seitenkennung jeder Seite.\";'),('de','messages:apihelp-query+linkshere-paramvalue-prop-redirect','s:50:\"Markieren, falls die Seite eine Weiterleitung ist.\";'),('de','messages:apihelp-query+linkshere-paramvalue-prop-title','s:18:\"Titel jeder Seite.\";'),('de','messages:apihelp-query+linkshere-summary','s:61:\"Alle Seiten finden, die auf die angegebenen Seiten verlinken.\";'),('de','messages:apihelp-query+logevents-example-simple','s:42:\"Listet die letzten Logbuch-Ereignisse auf.\";'),('de','messages:apihelp-query+logevents-param-action','s:210:\"Filter log actions to only this action. Overrides <var>$1type</var>. In the list of possible values, values with the asterisk wildcard such as <kbd>action/*</kbd> can have different strings after the slash (/).\";'),('de','messages:apihelp-query+logevents-param-end','s:52:\"Der Zeitstempel, bei dem die Aufzählung enden soll.\";'),('de','messages:apihelp-query+logevents-param-limit','s:67:\"Wie viele Ereigniseinträge insgesamt zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+logevents-param-namespace','s:47:\"Filter entries to those in the given namespace.\";'),('de','messages:apihelp-query+logevents-param-prefix','s:51:\"Filtert Einträge, die mit diesem Präfix beginnen.\";'),('de','messages:apihelp-query+logevents-param-prop','s:31:\"Zurückzugebende Eigenschaften:\";'),('de','messages:apihelp-query+logevents-param-start','s:55:\"Der Zeitstempel, bei dem die Aufzählung beginnen soll.\";'),('de','messages:apihelp-query+logevents-param-tag','s:45:\"Only list event entries tagged with this tag.\";'),('de','messages:apihelp-query+logevents-param-title','s:42:\"Filter entries to those related to a page.\";'),('de','messages:apihelp-query+logevents-param-type','s:51:\"Filtert nur Logbucheinträge mit diesem Typ heraus.\";'),('de','messages:apihelp-query+logevents-param-user','s:47:\"Filter entries to those made by the given user.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-comment','s:46:\"Ergänzt den Kommentar des Logbuchereignisses.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-details','s:45:\"Lists additional details about the log event.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-ids','s:44:\"Ergänzt die Kennung des Logbuchereignisses.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-parsedcomment','s:41:\"Adds the parsed comment of the log event.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-tags','s:49:\"Listet Markierungen für das Logbuchereignis auf.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-timestamp','s:45:\"Ergänzt den Zeitstempel des Logbucheintrags.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-title','s:54:\"Ergänzt den Titel der Seite für das Logbuchereignis.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-type','s:40:\"Ergänzt den Typ des Logbuchereignisses.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-user','s:64:\"Ergänzt den verantwortlichen Benutzer für das Logbuchereignis.\";'),('de','messages:apihelp-query+logevents-paramvalue-prop-userid','s:55:\"Adds the user ID who was responsible for the log event.\";'),('de','messages:apihelp-query+logevents-summary','s:35:\"Ruft Ereignisse von Logbüchern ab.\";'),('de','messages:apihelp-query+messagecollection-description','s:53:\"Ruft die Nachrichtensammlung über Übersetzungen ab.\";'),('de','messages:apihelp-query+messagecollection-example-1','s:29:\"Liste unterstützter Sprachen\";'),('de','messages:apihelp-query+messagecollection-example-2','s:85:\"Listet nicht-optionale Nachrichtendefinitionen für die Gruppe „page-Example“ auf\";'),('de','messages:apihelp-query+messagecollection-example-3','s:96:\"Listet optionale Nachrichten in Finnisch mit Markierungen für die Gruppe „page-Example“ auf\";'),('de','messages:apihelp-query+messagecollection-example-4','s:101:\"Weitere Informationen über die aktuellsten Übersetzungsversionen für die Gruppe „page-Example“\";'),('de','messages:apihelp-query+messagecollection-param-filter','s:726:\"Message collection filters. Use <kbd>!</kbd> to negate condition. For example <kbd>!fuzzy</kbd> means list only all non-fuzzy messages. Filters are applied in the order given.\n;fuzzy:Messages with fuzzy tag.\n;optional:Messages which should be translated only if changes are necessary.\n;ignored:Messages which are never translated.\n;hastranslation:Messages which have a translation regardless if it is fuzzy or not.\n;translated:Messages which have a translation which is not fuzzy.\n;changed:Messages which have been translated or changed since last export.\n;reviewer&#58;N:Messages where the user number <kbd>N</kbd> is among reviewers.\n;last-translator&#58;N:Messages where the user number <kbd>N</kbd> is the last translator.\";'),('de','messages:apihelp-query+messagecollection-param-group','s:18:\"Nachrichtengruppe.\";'),('de','messages:apihelp-query+messagecollection-param-language','s:11:\"Sprachcode.\";'),('de','messages:apihelp-query+messagecollection-param-limit','s:67:\"Wie viele Nachrichten angezeigt werden sollen (nach der Filterung).\";'),('de','messages:apihelp-query+messagecollection-param-offset','s:47:\"Ganzzahl oder Schlüsselversatz für den Start.\";'),('de','messages:apihelp-query+messagecollection-param-prop','s:406:\"Which properties to get:\n;definition:Message definition.\n;translation:Current translation (without $1 string if any, use the tags to check for outdated or broken translations).\n;tags:Message tags, like optional, ignored and fuzzy.\n;properties:Message properties, like status, revision, last-translator. Can vary between messages.\n;revision:<span class=\"deprecated\">Deprecated!</span> Use $2prop=properties.\";'),('de','messages:apihelp-query+messagecollection-summary','s:43:\"Query MessageCollection about translations.\";'),('de','messages:apihelp-query+messagegroups-description','s:121:\"Return information about message groups.\n\nNote that the uselang parameter affects the output of language dependent parts.\";'),('de','messages:apihelp-query+messagegroups-example-1','s:27:\"Nachrichtengruppen anzeigen\";'),('de','messages:apihelp-query+messagegroups-extended-description','s:79:\"Note that the uselang parameter affects the output of language dependent parts.\";'),('de','messages:apihelp-query+messagegroups-param-depth','s:218:\"When using the tree format, limit the depth to this many levels. Value 0 means that no subgroups are shown. If the limit is reached, the output includes a \"groupcount\" value, which states the number of direct children.\";'),('de','messages:apihelp-query+messagegroups-param-filter','s:124:\"Only return messages with IDs that match one or more of the inputs given (case-insensitive, separated by pipes, * wildcard).\";'),('de','messages:apihelp-query+messagegroups-param-format','s:75:\"In the tree format message groups can exist in multiple places in the tree.\";'),('de','messages:apihelp-query+messagegroups-param-iconsize','s:44:\"Bevorzugte Größe des Rastergruppensymbols.\";'),('de','messages:apihelp-query+messagegroups-param-prop','s:667:\"What translation-related information to get:\n;id:Include ID of the group.\n;label:Include label of the group.\n;description:Include description of the group.\n;class:Include class name of the group.\n;namespace:Include namespace of the group. Not all groups belong to a single namespace.\n;exists:Include self-calculated existence property of the group.\n;icon:Include URLs to icon of the group.\n;priority:Include priority status like discouraged.\n;prioritylangs:Include preferred languages. If not set, this returns false.\n;priorityforce:Include priority status - is the priority languages setting forced.\n;workflowstates:Include the workflow states for the message group.\";'),('de','messages:apihelp-query+messagegroups-param-root','s:201:\"When using the tree format, instead of starting from top level start from the given message group, which must be an aggregate message group. When using flat format only the specified group is returned.\";'),('de','messages:apihelp-query+messagegroups-summary','s:52:\"Gibt Informationen über Nachrichtengruppen zurück.\";'),('de','messages:apihelp-query+messagegroupstats-description','s:42:\"Ruft Statistiken zu Nachrichtengruppen ab.\";'),('de','messages:apihelp-query+messagegroupstats-example-1','s:88:\"Liste von Übersetzungs-Vollständigkeits-Statistiken für die Gruppe „page-Example“\";'),('de','messages:apihelp-query+messagegroupstats-param-group','s:26:\"Nachrichtengruppenkennung.\";'),('de','messages:apihelp-query+messagegroupstats-param-timelimit','s:119:\"Maximum time to spend calculating missing statistics. If zero, only the cached results from the beginning are returned.\";'),('de','messages:apihelp-query+messagegroupstats-summary','s:42:\"Ruft Statistiken zu Nachrichtengruppen ab.\";'),('de','messages:apihelp-query+messagetranslations-description','s:57:\"Ruft alle Übersetzungen für eine einzelne Nachricht ab.\";'),('de','messages:apihelp-query+messagetranslations-example-1','s:61:\"Liste der Übersetzungen im Wiki für „MediaWiki:January“\";'),('de','messages:apihelp-query+messagetranslations-param-title','s:47:\"Vollständiger Titel einer bekannten Nachricht.\";'),('de','messages:apihelp-query+messagetranslations-summary','s:44:\"Query all translations for a single message.\";'),('de','messages:apihelp-query+mystashedfiles-example-simple','s:87:\"Get the filekey, file size, and pixel size of files in the current user\'s upload stash.\";'),('de','messages:apihelp-query+mystashedfiles-param-limit','s:47:\"Wie viele Dateien zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+mystashedfiles-param-prop','s:62:\"Welche Eigenschaften für die Dateien abgerufen werden sollen.\";'),('de','messages:apihelp-query+mystashedfiles-paramvalue-prop-size','s:45:\"Ruft die Dateigröße und Bildabmessungen ab.\";'),('de','messages:apihelp-query+mystashedfiles-paramvalue-prop-type','s:42:\"Ruft den MIME- und Medientyp der Datei ab.\";'),('de','messages:apihelp-query+mystashedfiles-summary','s:55:\"Get a list of files in the current user\'s upload stash.\";'),('de','messages:apihelp-query+pagepropnames-example-simple','s:28:\"Get first 10 property names.\";'),('de','messages:apihelp-query+pagepropnames-param-limit','s:38:\"The maximum number of names to return.\";'),('de','messages:apihelp-query+pagepropnames-summary','s:48:\"List all page property names in use on the wiki.\";'),('de','messages:apihelp-query+pageprops-example-simple','s:75:\"Get properties for the pages <kbd>Main Page</kbd> and <kbd>MediaWiki</kbd>.\";'),('de','messages:apihelp-query+pageprops-param-prop','s:215:\"Only list these page properties (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use). Useful for checking whether pages use a certain page property.\";'),('de','messages:apihelp-query+pageprops-summary','s:56:\"Get various page properties defined in the page content.\";'),('de','messages:apihelp-query+pageswithprop-example-generator','s:89:\"Get additional information about the first 10 pages using <code>_&#95;NOTOC_&#95;</code>.\";'),('de','messages:apihelp-query+pageswithprop-example-simple','s:81:\"List the first 10 pages using <code>&#123;&#123;DISPLAYTITLE:&#125;&#125;</code>.\";'),('de','messages:apihelp-query+pageswithprop-param-dir','s:40:\"In welche Richtung sortiert werden soll.\";'),('de','messages:apihelp-query+pageswithprop-param-limit','s:45:\"Die maximale Anzahl zurückzugebender Seiten.\";'),('de','messages:apihelp-query+pageswithprop-param-prop','s:39:\"Which pieces of information to include:\";'),('de','messages:apihelp-query+pageswithprop-param-propname','s:163:\"Page property for which to enumerate pages (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use).\";'),('de','messages:apihelp-query+pageswithprop-paramvalue-prop-ids','s:30:\"Fügt die Seitenkennung hinzu.\";'),('de','messages:apihelp-query+pageswithprop-paramvalue-prop-title','s:44:\"Adds the title and namespace ID of the page.\";'),('de','messages:apihelp-query+pageswithprop-paramvalue-prop-value','s:36:\"Adds the value of the page property.\";'),('de','messages:apihelp-query+pageswithprop-summary','s:43:\"List all pages using a given page property.\";'),('de','messages:apihelp-query+prefixsearch-example-simple','s:57:\"Search for page titles beginning with <kbd>meaning</kbd>.\";'),('de','messages:apihelp-query+prefixsearch-extended-description','s:508:\"Despite the similarity in names, this module is not intended to be equivalent to [[Special:PrefixIndex]]; for that, see <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd> with the <kbd>apprefix</kbd> parameter. The purpose of this module is similar to <kbd>[[Special:ApiHelp/opensearch|action=opensearch]]</kbd>: to take user input and provide the best-matching titles. Depending on the search engine backend, this might include typo correction, redirect avoidance, or other heuristics.\";'),('de','messages:apihelp-query+prefixsearch-param-limit','s:45:\"Maximale Anzahl zurückzugebender Ergebnisse.\";'),('de','messages:apihelp-query+prefixsearch-param-namespace','s:134:\"Welche Namensräume durchsucht werden sollen. Wird ignoriert, falls <var>$1search</var> mit einem gültigen Namensraumpräfix beginnt.\";'),('de','messages:apihelp-query+prefixsearch-param-offset','s:42:\"Anzahl der zu überspringenden Ergebnisse.\";'),('de','messages:apihelp-query+prefixsearch-param-profile','s:27:\"Zu verwendendes Suchprofil.\";'),('de','messages:apihelp-query+prefixsearch-param-search','s:18:\"Such-Zeichenfolge.\";'),('de','messages:apihelp-query+prefixsearch-summary','s:40:\"Perform a prefix search for page titles.\";'),('de','messages:apihelp-query+protectedtitles-example-generator','s:53:\"Find links to protected titles in the main namespace.\";'),('de','messages:apihelp-query+protectedtitles-example-simple','s:29:\"Listet geschützte Titel auf.\";'),('de','messages:apihelp-query+protectedtitles-param-end','s:42:\"Stop listing at this protection timestamp.\";'),('de','messages:apihelp-query+protectedtitles-param-level','s:46:\"Only list titles with these protection levels.\";'),('de','messages:apihelp-query+protectedtitles-param-limit','s:56:\"Wie viele Seiten insgesamt zurückgegeben werden sollen.\";'),('de','messages:apihelp-query+protectedtitles-param-namespace','s:37:\"Only list titles in these namespaces.\";'),('de','messages:apihelp-query+protectedtitles-param-prop','s:31:\"Zurückzugebende Eigenschaften:\";'),('de','messages:apihelp-query+protectedtitles-param-start','s:43:\"Start listing at this protection timestamp.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-comment','s:36:\"Adds the comment for the protection.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-expiry','s:57:\"Adds the timestamp of when the protection will be lifted.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-level','s:26:\"Ergänzt den Schutzstatus.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-parsedcomment','s:43:\"Adds the parsed comment for the protection.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-timestamp','s:48:\"Adds the timestamp of when protection was added.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-user','s:40:\"Adds the user that added the protection.\";'),('de','messages:apihelp-query+protectedtitles-paramvalue-prop-userid','s:43:\"Adds the user ID that added the protection.\";'),('de','messages:apihelp-query+protectedtitles-summary','s:64:\"Listet alle Titel auf, die vor einer Erstellung geschützt sind.\";'),('de','messages:apihelp-query+querypage-example-ancientpages','s:45:\"Return results from [[Special:Ancientpages]].\";'),('de','messages:apihelp-query+querypage-param-limit','s:40:\"Anzahl der zurückzugebenden Ergebnisse.\";'),('de','messages:apihelp-query+querypage-param-page','s:59:\"The name of the special page. Note, this is case sensitive.\";'),('de','messages:apihelp-query+querypage-summary','s:54:\"Get a list provided by a QueryPage-based special page.\";'),('de','messages:apihelp-query+random-example-generator','s:64:\"Return page info about two random pages from the main namespace.\";'),('de','messages:apihelp-query+random-example-simple','s:48:\"Return two random pages from the main namespace.\";'),('de','messages:apihelp-query+random-extended-description','s:298:\"Pages are listed in a fixe