wort.\";'),('de','messages:apihelp-validatepassword-param-realname','s:77:\"Der beim Austesten der Benutzerkontenerstellung verwendete bürgerliche Name.\";'),('de','messages:apihelp-validatepassword-param-user','s:123:\"Der beim Austesten der Benutzerkontenerstellung verwendete Benutzername. Der angegebene Benutzer darf nicht vorhanden sein.\";'),('de','messages:apihelp-validatepassword-summary','s:63:\"Validiert ein Passwort gegen die Passwortrichtlinien des Wikis.\";'),('de','messages:apihelp-watch-example-generator','s:48:\"Watch the first few pages in the main namespace.\";'),('de','messages:apihelp-watch-example-unwatch','s:48:\"Die Seite <kbd>Main Page</kbd> nicht beobachten.\";'),('de','messages:apihelp-watch-example-watch','s:42:\"Die Seite <kbd>Main Page</kbd> beobachten.\";'),('de','messages:apihelp-watch-param-title','s:55:\"The page to (un)watch. Use <var>$1titles</var> instead.\";'),('de','messages:apihelp-watch-param-unwatch','s:54:\"If set the page will be unwatched rather than watched.\";'),('de','messages:apihelp-watch-summary','s:54:\"Add or remove pages from the current user\'s watchlist.\";'),('de','messages:apihelp-xml-param-includexmlnamespace','s:47:\"Falls angegeben, ergänzt einen XML-Namensraum.\";'),('de','messages:apihelp-xml-param-xslt','s:166:\"Falls angegeben, fügt die benannte Seite als XSL-Stylesheet hinzu. Der Wert muss ein Titel im Namensraum „{{ns:MediaWiki}}“ sein und mit <code>.xsl</code> enden.\";'),('de','messages:apihelp-xml-summary','s:29:\"Daten im XML-Format ausgeben.\";'),('de','messages:apihelp-xmlfm-summary','s:54:\"Daten im XML-Format ausgeben (schöngedruckt in HTML).\";'),('de','messages:apisandbox','s:14:\"API-Spielwiese\";'),('de','messages:apisandbox-add-multi','s:11:\"Hinzufügen\";'),('de','messages:apisandbox-alert-field','s:41:\"Der Wert dieses Feldes ist nicht gültig.\";'),('de','messages:apisandbox-alert-page','s:43:\"Felder auf dieser Seite sind nicht gültig.\";'),('de','messages:apisandbox-api-disabled','s:42