in}} wurde schon früher gesperrt. Es folgt der Eintrag aus dem Benutzersperr-Logbuch:\";'),('de','messages:blocklog-showsuppresslog','s:144:\"{{GENDER:$1|Dieser Benutzer|Diese Benutzerin}} wurde schon früher gesperrt und versteckt.\nEs folgt der Eintrag aus dem Unterdrückungs-Logbuch:\";'),('de','messages:blocklogentry','s:45:\"sperrte „[[$1]]“ für den Zeitraum: $2 $3\";'),('de','messages:blocklogpage','s:21:\"Benutzersperr-Logbuch\";'),('de','messages:blocklogtext','s:252:\"Dies ist das Logbuch über Sperrungen und Entsperrungen von Benutzern und IP-Adressen.\nAutomatisch gesperrte IP-Adressen werden nicht erfasst.\nSiehe die [[Special:BlockList|Liste der gesperrten IP-Adressen und Benutzernamen]] für alle aktiven Sperren.\";'),('de','messages:bold_sample','s:11:\"Fetter Text\";'),('de','messages:bold_tip','s:11:\"Fetter Text\";'),('de','messages:booksources','s:10:\"ISBN-Suche\";'),('de','messages:booksources-invalid-isbn','s:97:\"Vermutlich ist die ISBN ungültig.\nBitte prüfe, ob sie korrekt von der Quelle übertragen wurde.\";'),('de','messages:booksources-isbn','s:5:\"ISBN:\";'),('de','messages:booksources-search','s:6:\"Suchen\";'),('de','messages:booksources-search-legend','s:37:\"Suche nach Bezugsquellen für Bücher\";'),('de','messages:booksources-summary','s:0:\"\";'),('de','messages:booksources-text','s:225:\"Dies ist eine Liste mit Links zu Internetseiten, die neue und gebrauchte Bücher verkaufen. Dort kann es auch weitere Informationen über die Bücher geben. {{SITENAME}} ist mit keinem dieser Anbieter geschäftlich verbunden.\";'),('de','messages:boteditletter','s:1:\"B\";'),('de','messages:botpasswords','s:14:\"Botpasswörter\";'),('de','messages:botpasswords-bad-appid','s:39:\"Der Botname „$1“ ist nicht gültig.\";'),('de','messages:botpasswords-created-body','s:110:\"Das Botpasswort für den Botnamen „$1“ {{GENDER:$2|des Benutzers|der Benutzerin}} „$2“ wurde erstellt.\";'),('de','messages:botpasswords-created-title','s:20:\"Botpasswort erstellt\";'),('de','