ation kopieren.\n\n; Sofern du MediaWiki gerade aktualisiert hast\n: Bei MediaWiki 1.24 und neueren Versionen werden die installierten Benutzeroberflächen nicht mehr automatisch aktiviert (siehe das [https://www.mediawiki.org/wiki/Manual:Skin_autodiscovery Benutzerhandbuch]). Du kannst die {{PLURAL:$5|folgende Zeile|folgenden Zeilen}} in die Datei <code>LocalSettings.php</code> einfügen, um {{PLURAL:$5|die installierte Benutzeroberfläche|alle installierten Benutzeroberflächen}} zu aktivieren:\n\n<pre dir=\"ltr\">$3</pre>\n\n; Falls du gerade die Datei <code>LocalSettings.php</code> geändert hast\n: Überprüfe die Namen der Benutzeroberflächen auf Tippfehler.\";'),('de','messages:default-skin-not-found-no-skins','s:1564:\"Hoppla! Die mit <code>$wgDefaultSkin</code> als <code>$1</code>&nbsp;für dein Wiki definierte Standardbenutzeroberfläche ist nicht verfügbar.\n\nDu hast keine Benutzeroberfläche installiert.\n\n; Sofern du MediaWiki gerade installiert oder aktualisiert hast\n: Du hast MediaWiki vermutlich mit Hilfe von Git oder den Quellcode direkt anhand einer anderen Methode installiert. Das aktuelle Problem war deshalb zu erwarten, da MediaWiki 1.24 und neuere Versionen keine Benutzeroberflächen im Hauptrepositorium enthalten. Installiere zumindest eine im [https://www.mediawiki.org/wiki/Category:All_skins Verzeichnis der Benutzeroberflächen] enthaltene Benutzeroberfläche indem du:\n:* [https://www.mediawiki.org/wiki/Download_from_Git#Using_Git_to_download_MediaWiki_skins Git zum Herunterladen von Benutzeroberflächen verwendest].\n:* die Dateiveröffentlichungen einzelner Benutzeroberflächen aus [https://www.mediawiki.org/wiki/Special:SkinDistributor MediaWiki.org] herunterlädst und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopierst,\n:* die [https://www.mediawiki.org/wiki/Download/de Dateiveröffentlichung von MediaWiki] herunterlädst, die verschiedene Benutzeroberflächen sowie Erweiterungen enthält. Du kannst das dort enthaltene Verzeichnis <code>skins/</code> Verzeichnis nutzen und in das Verzeichnis <code dir=\"ltr\">skins/</code> deiner MediaWiki-Installation kopieren.\n: Siehe hierzu das [https://www.mediawiki.org/wiki/Manual:Skin_configuration/de Benutzerhandbuch zur Konfiguration von Benutzeroberflächen].\";'),('de','messages:default-skin-not-found-row-disabled','s:53:\"* <code>$1</code> / $2 (<strong>deaktiviert</strong>)\";'),('de','messages:default-skin-not-found-row-enabled','s:34:\"* <code>$1</code> / $2 (aktiviert)\";'),('de','messages:defaultmessagetext','s:12:\"Standardtext\";'),('de','messages:defemailsubject','s:70:\"{{SITENAME}} – E-Mail von {{GENDER:$1|Benutzer|Benutzerin}} „$1“\";'),('de','messages:delete','s:8:\"Löschen\";'),('de','messages:delete-confirm','s:21:\"Löschen von „$1“\";'),('de','messages:delete-edit-reasonlist','s:24:\"Löschgründe bearbeiten\";'),('de','messages:delete-hook-aborted','s:117:\"Die Löschung wurde von einer Programmerweiterung zu MediaWiki verhindert.\nEs ist hierzu keine Erklärung verfügbar.\";'),('de','messages:delete-legend','s:8:\"Löschen\";'),('de','messages:delete-toobig','s:211:\"Diese Seite hat mit mehr als $1 {{PLURAL:$1|Version|Versionen}} eine sehr lange Versionsgeschichte. Das Löschen solcher Seiten wurde eingeschränkt, um eine versehentliche Überlastung der Server zu verhindern.\";'),('de','messages:delete-warning-toobig','s:160:\"Diese Seite hat mit mehr als $1 {{PLURAL:$1|Version|Versionen}} eine sehr lange Versionsgeschichte. Das Löschen kann zu Störungen im Datenbankbetrieb führen.\";'),('de','messages:delete_and_move_confirm','s:18:\"Ja, Seite löschen\";'),('de','messages:delete_and_move_reason','s:68:\"Gelöscht, um Platz für die Verschiebung von „[[$1]]“ zu machen\";'),('de','messages:delete_and_move_text','s:108:\"Die Seite „[[:$1]]“ existiert bereits.\nMöchtest du diese löschen, um die Seite verschieben zu können?\";'),('de','messages:deletecomment','s:6:\"Grund:\";'),('de','messages:deletedarticle','s:16:\"deleted \"[[