de','messages:expand_templates_input_missing','s:51:\"Du musst mindestens einen Eingabe-Wikitext angeben.\";'),('de','messages:expand_templates_intro','s:346:\"Auf dieser Spezialseite kann Wikitext eingegeben werden. Alle enthaltenen Vorlagen werden dabei rekursiv expandiert.\nAuch Parserfunktionen wie\n<code><nowiki>{{</nowiki>#language:…}}</code> und Variablen wie\n<code><nowiki>{{</nowiki>CURRENTDAY}}</code> werden ausgewertet –\nfaktisch alles, was in doppelten geschweiften Klammern enthalten ist.\";'),('de','messages:expand_templates_ok','s:19:\"Vorlage expandieren\";'),('de','messages:expand_templates_output','s:8:\"Ergebnis\";'),('de','messages:expand_templates_preview','s:8:\"Vorschau\";'),('de','messages:expand_templates_preview_fail_html','s:455:\"<em>Da {{SITENAME}} rohes HTML aktiviert hat und es einen Verlust deiner Sitzungsdaten gab, ist die Vorschau als Vorsichtsmaßnahme gegen JavaScript-Angriffe versteckt.</em>\n\n<strong>Falls dies ein zulässiger Vorschauversuch ist, versuche es bitte erneut.</strong>\nFalls dieses Problem weiterhin bestehen bleibt, versuche dich [[Special:UserLogout|abzumelden]] und erneut anzumelden und überprüfe, ob dein Browser Cookies von dieser Website akzeptiert.\";'),('de','messages:expand_templates_preview_fail_html_anon','s:288:\"<em>Da {{SITENAME}} rohes HTML aktiviert hat und du nicht angemeldet bist, ist die Vorschau als Vorsichtsmaßnahme gegen JavaScript-Angriffe versteckt.</em>\n\n<strong>Falls dies ein zulässiger Vorschauversuch ist, [[Special:UserLogin|melde dich bitte an]] und versuche es erneut.</strong>\";'),('de','messages:expand_templates_remove_comments','s:20:\"Kommentare entfernen\";'),('de','messages:expand_templates_remove_nowiki','s:42:\"<nowiki>-Tags in der Ausgabe unterdrücken\";'),('de','messages:expand_templates_title','s:50:\"Kontexttitel für beispielsweise {{FULLPAGENAME}}:\";'),('de','messages:expand_templates_xml_output','s:11:\"XML-Ausgabe\";'),('de','messages:expandtemplates','s:20:\"Vorlagen expandieren\";'),('de','messages:expansion-depth-exceeded-category','s:52:\"Seiten, die die Expansionstiefe überschritten haben\";'),('de','messages:expansion-depth-exceeded-category-desc','s:57:\"Die Seite überschreitet die maximale Expandierungstiefe.\";'),('de','messages:expansion-depth-exceeded-warning','s:49:\"Die Seite hat die Expansionstiefe überschritten.\";'),('de','messages:expensive-parserfunction-category','s:56:\"Seiten, die aufwändige Parserfunktionen zu oft aufrufen\";'),('de','messages:expensive-parserfunction-category-desc','s:205:\"Die Seite verwendet zu viele aufwändige Parserfunktionen (wie <code>#ifexist</code>). Siehe das [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgExpensiveParserFunctionLimit Benutzerhandbuch].\";'),('de','messages:expensive-parserfunction-warning','s:211:\"\'\'\'Achtung:\'\'\' Diese Seite enthält zu viele Aufrufe aufwändiger Parserfunktionen.\n\nSie darf nicht mehr als $2 {{PLURAL:$2|Aufruf|Aufrufe}} haben, es {{PLURAL:$1|ist aktuell $1 Aufruf|sind aktuell $1 Aufrufe}}.\";'),('de','messages:expiringblock','s:21:\"endet am $1 um $2 Uhr\";'),('de','messages:explainconflict','s:365:\"Jemand anders hat diese Seite geändert, nachdem du angefangen hast, sie zu bearbeiten.\nDas obere Textfeld enthält den aktuellen Bearbeitungsstand der Seite.\nDas untere Textfeld enthält deine Änderungen.\nBitte füge deine Änderungen in das obere Textfeld ein.\n<strong>Nur</strong> der Inhalt des oberen Textfeldes wird gespeichert, wenn du auf „$1“ klickst.\";'),('de','messages:export','s:18:\"Seiten exportieren\";'),('de','messages:export-addcat','s:11:\"Hinzufügen\";'),('de','messages:export-addcattext','s:43:\"Seiten aus folgender Kategorie hinzufügen:\";'),('de','messages:export-addns','s:11:\"Hinzufügen\";'),('de','messages:export-addnstext','s:44:\"Seiten aus folgendem Namensraum hinzufügen:\";'),('de','messages:export-download','s:23:\"Als XML-Datei speichern\";'),('de','messages:export-manual','s:27:\"Seiten manuell hinzufügen