tisch verschoben werden.\";'),('de','messages:movepage-moved','s:56:\"\'\'\'Die Seite „$1“ wurde nach „$2“ verschoben.\'\'\'\";'),('de','messages:movepage-moved-noredirect','s:54:\"Die Erstellung einer Weiterleitung wurde unterdrückt.\";'),('de','messages:movepage-moved-redirect','s:34:\"Eine Weiterleitung wurde erstellt.\";'),('de','messages:movepage-page-exists','s:90:\"Die Seite „$1“ ist bereits vorhanden und kann nicht automatisch überschrieben werden.\";'),('de','messages:movepage-page-moved','s:50:\"Die Seite „$1“ wurde nach „$2“ verschoben.\";'),('de','messages:movepage-page-unmoved','s:64:\"Die Seite „$1“ konnte nicht nach „$2“ verschoben werden.\";'),('de','messages:movepage-summary','s:0:\"\";'),('de','messages:movepagebtn','s:17:\"Seite verschieben\";'),('de','messages:movepagetalktext','s:293:\"Falls du dieses Kästchen aktivierst, wird die dazugehörige Diskussionsseite automatisch auf den neuen Titel verschoben, sofern nicht bereits eine nicht-leere Diskussionsseite dort vorhanden ist.\n\nIn diesem Fall musst du die Seite manuell verschieben oder zusammenführen, falls erforderlich.\";'),('de','messages:movepagetext','s:1065:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nDu kannst Weiterleitungen, die auf den Originaltitel verlinken, automatisch korrigieren lassen.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|defekten Weiterleitungen]] überprüfst.\nDu bist dafür verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird <strong>nicht</strong> verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, letztere ist eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rückgängig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine existierende Seite überschreiben.\n\n<strong>Hinweis:</strong>\nDie Verschiebung kann weitreichende und unerwartete Folgen für häufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfährst.\";'),('de','messages:movepagetext-noredirectfixer','s:966:\"Mit untenstehendem Formular kannst du eine Seite umbenennen, indem du sie mitsamt allen Versionen auf einen neuen Titel verschiebst.\nDer alte Titel wird danach zum neuen weiterleiten.\nStelle sicher, dass du im Anschluss alle [[Special:DoubleRedirects|doppelten]] oder [[Special:BrokenRedirects|defekten Weiterleitungen]] überprüfst.\nDu bist dafür verantwortlich, dass Links weiterhin auf das korrekte Ziel verweisen.\n\nDie Seite wird <strong>nicht</strong> verschoben, sofern es bereits eine Seite mit dem vorgesehenen Titel gibt, es sei denn, diese ist eine Weiterleitung ohne Versionsgeschichte.\nDies bedeutet, dass du die Umbenennung rückgängig machen kannst, sofern du einen Fehler gemacht hast. Du kannst hingegen keine existierende Seite überschreiben.\n\n<strong>Hinweis:</strong>\nDie Verschiebung kann weitreichende und unerwartete Folgen für häufig besuchte Seiten haben.\nDu solltest daher die Konsequenzen verstanden haben, bevor du jetzt fortfährst.\";'),('de','messages:movereason','s:6:\"Grund:\";'),('de','messages:movesubpage','s:36:\"{{PLURAL:$1|Unterseite|Unterseiten}}\";'),('de','messages:movesubpagetalktext','s:138:\"Die dazugehörige Diskussionsseite hat {{PLURAL:$1|eine Unterseite, die unten angezeigt wird|$1 Unterseiten, die unten angezeigt werden}}.\";'),('de','messages:movesubpagetext','s:56:\"Diese Seite hat $1 {{PLURAL:$1|Unterseite|Unterseiten}}.\";'),('de','messages:movetalk','s:52:\"Sofern möglich, die Diskussionsseite mitverschieben\";'),('de','messages:movethispage','s:17:\"Seite verschieben\";'),('de','messages:moveuserpage-warning','s:186:\"<strong>Warnung:</strong> Du bist dabei, eine Benutzerseite zu verschieben. Bitte bedenke, dass dadurch nur die Benutzerseite 