ss sich von deinem Benutzernamen unterscheiden.\";'),('de','messages:passwordremindertext','s:461:\"Jemand mit der IP-Adresse $1 hat ein neues Passwort für die Anmeldung bei {{SITENAME}} ($4) angefordert.\n\nDas automatisch generierte Passwort für Benutzer „$2“ lautet nun: $3\n\nFalls du dies wirklich gewünscht hast, solltest du dich jetzt anmelden und das Passwort ändern.\nDas neue Passwort ist {{PLURAL:$5|einen Tag|$5 Tage}} gültig.\n\nBitte ignoriere diese E-Mail, falls du sie nicht selbst angefordert hast. Das alte Passwort bleibt weiterhin gültig.\";'),('de','messages:passwordremindertitle','s:63:\"Neues temporäres Passwort für dein {{SITENAME}}-Benutzerkonto\";'),('de','messages:passwordreset','s:22:\"Passwort zurücksetzen\";'),('de','messages:passwordreset-disabled','s:68:\"Das Zurücksetzen von Passwörtern wurde in diesem Wiki deaktiviert.\";'),('de','messages:passwordreset-domain','s:7:\"Domain:\";'),('de','messages:passwordreset-email','s:15:\"E-Mail-Adresse:\";'),('de','messages:passwordreset-emaildisabled','s:57:\"Die E-Mail-Funktionen wurden auf diesem Wiki deaktiviert.\";'),('de','messages:passwordreset-emailelement','s:44:\"Benutzername: \n$1\n\nTemporäres Passwort: \n$2\";'),('de','messages:passwordreset-emailsentemail','s:119:\"Falls diese E-Mail-Adresse mit deinem Benutzerkonto verknüpft ist, wird eine Passwort-Zurücksetzungs-E-Mail versandt.\";'),('de','messages:passwordreset-emailsentusername','s:131:\"Falls es eine E-Mail-Adresse gibt, die mit diesem Benutzernamen verknüpft ist, wird eine Passwort-Zurücksetzungs-E-Mail versandt.\";'),('de','messages:passwordreset-emailtext-ip','s:687:\"Jemand mit der IP-Adresse $1, wahrscheinlich du selbst, hat eine Zurücksetzung deines Passworts bei {{SITENAME}} angefordert ($4). {{PLURAL:$3|Das folgende Benutzerkonto ist|Die folgenden Benutzerkonten sind}} mit dieser E-Mail-Adresse verknüpft:\n\n$2\n\n{{PLURAL:$3|Dieses temporäre Passwort läuft|Diese temporären Passwörter laufen}} innerhalb von {{PLURAL:$5|einem Tag|$5 Tagen}} ab.\nDu solltest dich anmelden und ein neues Passwort vergeben. Falls jemand anderes diese Anfrage getätigt hat oder du dich wieder an dein ursprüngliches Passwort erinnern kannst und es nicht länger ändern möchtest, kannst du diese Nachricht ignorieren und weiterhin dein altes Passwort benutzen.\";'),('de','messages:passwordreset-emailtext-user','s:652:\"Benutzer $1 bei {{SITENAME}} hat eine Zurücksetzung deines Passworts bei {{SITENAME}} angefordert ($4). {{PLURAL:$3|Das folgende Benutzerkonto ist|Die folgenden Benutzerkonten sind}} mit dieser E-Mail-Adresse verknüpft:\n\n$2\n\n{{PLURAL:$3|Dieses temporäre Passwort läuft|Diese temporären Passwörter laufen}} innerhalb von {{PLURAL:$5|einem Tag|$5 Tagen}} ab. Du solltest dich anmelden und ein neues Passwort vergeben. Falls jemand anderes diese Anfrage getätigt hat oder du dich wieder an dein ursprüngliches Passwort erinnern kannst und es nicht ändern möchtest, kannst du diese Nachricht ignorieren und weiterhin dein altes Passwort benutzen.\";'),('de','messages:passwordreset-emailtitle','s:43:\"Benutzerkontoinformationen auf {{SITENAME}}\";'),('de','messages:passwordreset-ignored','s:110:\"Die Passwortzurücksetzung konnte nicht verarbeitet werden. Vielleicht wurde kein Dienstanbieter konfiguriert?\";'),('de','messages:passwordreset-invalidemail','s:25:\"Ungültige E-Mail-Adresse\";'),('de','messages:passwordreset-nocaller','s:34:\"Es muss ein Rufer angegeben werden\";'),('de','messages:passwordreset-nodata','s:63:\"Weder ein Benutzername noch eine E-Mail-Adresse wurde angegeben\";'),('de','messages:passwordreset-nosuchcaller','s:29:\"Rufer ist nicht vorhanden: $1\";'),('de','messages:passwordreset-text-many','s:104:\"{{PLURAL:$1|Fülle eines der Felder aus, um ein temporäres Passwort per E-Mail zugesandt zu bekommen.}}\";'),('de','messages:passwordreset-text-one','s:79:\"Fülle dieses Formular aus, um ein temporäres Passwort per E-Mail zu erhalten.\";'),('de','messages:passwordreset-username','s:13:\"Be