sche Weiterleitungsziel angegeben oder du bearbeitest die falsche Seite.\nWenn du erneut auf „$1“ klickst, wird die Weiterleitung dennoch erstellt.\";'),('de','messages:semanticstatistics','s:33:\"Statistiken zu semantischen Daten\";'),('de','messages:semicolon-separator','s:6:\";&#32;\";'),('de','messages:semiprotectedpagemovewarning','s:174:\"\'\'\'Hinweis:\'\'\' Diese Seite wurde so geschützt, dass sie nur von automatisch bestätigten Benutzern verschoben werden kann.\nZur Information folgt der aktuelle Logbucheintrag:\";'),('de','messages:semiprotectedpagewarning','s:166:\"\'\'\'Halbsperrung:\'\'\' Die Seite wurde so geschützt, dass nur automatisch bestätigte Benutzer diese ändern können.\nZur Information folgt der aktuelle Logbucheintrag:\";'),('de','messages:sep','s:4:\"Sep.\";'),('de','messages:september','s:9:\"September\";'),('de','messages:september-date','s:13:\"$1. September\";'),('de','messages:september-gen','s:10:\"Septembers\";'),('de','messages:servertime','s:29:\"Aktuelle Zeit auf dem Server:\";'),('de','messages:session_fail_preview','s:415:\"Entschuldigung! Wir konnten deine Bearbeitung nicht verarbeiten, da Sitzungsdaten verloren gegangen sind.\n\nDu wurdest eventuell abgemeldet. <strong>Bitte verifiziere, dass du noch angemeldet bist und versuche es erneut</strong>.\nFalls dies nicht funktioniert, versuche dich [[Special:UserLogout|abzumelden]] und anschließend wieder anzumelden und überprüfe, ob dein Browser Cookies von dieser Website akzeptiert.\";'),('de','messages:session_fail_preview_html','s:528:\"Deine Bearbeitung konnte nicht gespeichert werden, da Sitzungsdaten verloren gegangen sind.\n\n<em>Da in {{SITENAME}} das Speichern von reinem HTML aktiviert ist, wurde die Vorschau ausgeblendet, um JavaScript-Attacken vorzubeugen.</em>\n\n<strong>Bitte versuche es erneut, indem du unter der folgenden Textvorschau nochmals auf „Seite speichern“ klickst.</strong>\nSollte das Problem bestehen bleiben, [[Special:UserLogout|melde dich ab]] und danach wieder an. Überprüfe, ob dein Browser Cookies von dieser Website akzeptiert.\";'),('de','messages:sessionfailure','s:239:\"Es gab ein Problem bei der Übertragung deiner Benutzerdaten.\nDiese Aktion wurde daher sicherheitshalber abgebrochen, um eine falsche Zuordnung deiner Änderungen zu einem anderen Benutzer zu verhindern.\nBitte sende das Formular erneut ab.\";'),('de','messages:sessionfailure-title','s:14:\"Sitzungsfehler\";'),('de','messages:sessionmanager-tie','s:74:\"Mehrere Anfrageauthentifikationstypen konnten nicht kombiniert werden: $1.\";'),('de','messages:sessionprovider-generic','s:12:\"$1-Sitzungen\";'),('de','messages:sessionprovider-mediawiki-session-cookiesessionprovider','s:25:\"cookiebasierten Sitzungen\";'),('de','messages:sessionprovider-nocookies','s:102:\"Cookies sind eventuell deaktiviert. Stelle sicher, dass Cookies aktiviert sind und versuche es erneut.\";'),('de','messages:shared-repo','s:38:\"einem gemeinsam genutzten Medienarchiv\";'),('de','messages:shared-repo-from','s:6:\"aus $1\";'),('de','messages:shared-repo-name-wikimediacommons','s:17:\"Wikimedia Commons\";'),('de','messages:shareddescriptionfollows','s:1:\"-\";'),('de','messages:sharedupload','s:74:\"Diese Datei stammt aus $1 und darf von anderen Projekten verwendet werden.\";'),('de','messages:sharedupload-desc-create','s:173:\"Diese Datei stammt aus $1 und kann von anderen Projekten verwendet werden.\nVielleicht möchtest du die Beschreibung auf der dortigen [$2 Dateibeschreibungsseite] bearbeiten.\";'),('de','messages:sharedupload-desc-edit','s:173:\"Diese Datei stammt aus $1 und kann auf anderen Projekten verwendet werden.\nVielleicht möchtest du die Beschreibung auf der dortigen [$2 Dateibeschreibungsseite] bearbeiten.\";'),('de','messages:sharedupload-desc-here','s:152:\"Diese Datei stammt aus $1 und kann von anderen Projekten verwendet werden. Die Beschreibung von deren [$2 Dateibeschreibungsseite] wird unten angezeigt.\";'),('de','messages:sharedupload-desc-there','s:146:\"Diese Datei stammt aus $1 und darf von anderen Projekten verwendet werden. Siehe auf der [$2 Dateibeschreibungsseite] nach weiteren Informationen.\";'),('de','messages:shortpages','s:12:\"Kurze Seiten\";'),('de','messages:shortpages-summary','s:0:\"\";'),('de','messages:show','s:10:\"einblenden\";'),('de','messages:show-big-image','s:13:\"Originaldatei\";'),('de','messages:show-big-image-other','s:50:\"Weitere {{PLURAL:$2|Auflösung|Auflösungen}}: $1.\";'),('de','messages:show-big-image-preview','s:28:\"Größe dieser Vorschau: $1.\";'),('de','messages:show-big-image-preview-differ','s:44:\"Größe der $3-Vorschau dieser $2-Datei: $1.\";'),('de','messages:show-big-image-size','s:14:\"$1 × $2 Pixel\";'),('de','messages:showdiff','s:18:\"Änderungen zeigen\";'),('de','messages:showhideselectedlogentries','s:49:\"Ausgewählte Logbucheinträge anzeigen/verstecken\";'),('de','messages:showhideselectedversions','s:37:\"Gewählte Versionen zeigen/verstecken\";'),('de','messages:showingresults','s:96:\"Hier {{PLURAL:$1|ist \'\'\'1\'\'\' Ergebnis|sind \'\'\'$1\'\'\' Ergebnisse}}, beginnend mit Nummer \'\'\'$2.\'\'\'\";'),('de','messages:showingresultsinrange','s:165:\"Unten {{PLURAL:$1|wird <strong>ein</strong> Ergebnis|werden bis zu <strong>$1</strong> Ergebnisse}} im Bereich <strong>$2</strong> bis <strong>$3</strong> angezeigt.\";'),('de','messages:shown-title','s:52:\"Zeige $1 {{PLURAL:$1|Ergebnis|Ergebnisse}} pro Seite\";'),('de','messages:showpreview','s:15:\"Vorschau zeigen\";'),('de','messages:showtoc','s:8:\"Anzeigen\";'),('de','messages:sidebar','s:158:\"\n* navigation\n** mainpage|mainpage-description\n** recentchanges-url|recentchanges\n** randompage-url|randompage\n** helppage|help\n* SEARCH\n* TOOLBOX\n* LANGUAGES\";'),('de','messages:sig-text','s:4:\"--$1\";'),('de','messages:sig_tip','s:30:\"Deine Signatur mit Zeitstempel\";'),('de','messages:signature','s:58:\"[[{{ns:user}}:$1|$2]] ([[{{ns:user_talk}}:$1|Diskussion]])\";'),('de','messages:signature-anon','s:36:\"[