;'),('de','messages:size-yottapixel','s:5:\"$1 YP\";'),('de','messages:size-zetabytes','s:5:\"$1 ZB\";'),('de','messages:size-zetapixel','s:5:\"$1 ZP\";'),('de','messages:skin-preview','s:8:\"Vorschau\";'),('de','messages:skinname-monobook','s:8:\"MonoBook\";'),('de','messages:skinname-timeless','s:8:\"Timeless\";'),('de','messages:skinname-vector','s:6:\"Vector\";'),('de','messages:smw-admin-announce','s:18:\"Wiki bekannt geben\";'),('de','messages:smw-admin-announce-text','s:160:\"Sofern dieses Wiki öffentlich zugänglich ist, kann es auf <a href=\"https://wikiapiary.com\">WikiApiary</a>, dem Wiki zum Tracken von Wikis, registriert werden.\";'),('de','messages:smw-admin-bugsreport','s:127:\"Softwarefehler können bei <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/issues\">GitHub</a> berichtet werden.\";'),('de','messages:smw-admin-db','s:41:\"Datenbankinstallation und -aktualisierung\";'),('de','messages:smw-admin-dbbutton','s:42:\"Tabellen initialisieren oder aktualisieren\";'),('de','messages:smw-admin-dbdocu','s:711:\"Semantic MediaWiki benötigt weitere Datentabellen in der von MediaWiki genutzten Datenbank, um die semantischen Daten speichern zu können. Die folgende Sonderaufgabe gewährleistet, dass die Datenbank richtig eingerichtet wird. Die Datenbankänderungen, die in diesem Schritt durchgeführt werden, beeinträchtigen den übrigen Teil der von MediaWiki genutzten Datenbank nicht. Sie können, sofern dies gewünscht ist, leicht rückgängig gemacht werden.\nDiese Sonderaufgabe zur Einrichtung der Datentabellen kann mehrere Male ausgeführt werden, ohne Schaden zu verursachen. Indes ist es lediglich notwendig, sie einmal während der Installation oder der Aktualisierung von Semantic MediaWiki durchzuführen.\";'),('de','messages:smw-admin-deprecation-notice-config-notice','s:112:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> ist veraltet und wird mit Version $2 entfernt.\";'),('de','messages:smw-admin-deprecation-notice-config-removal','s:96:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> wurde mit Version $2 entfernt.\";'),('de','messages:smw-admin-deprecation-notice-config-replacement','s:151:\"<code>[https://www.semantic-mediawiki.org/wiki/Help:$1 $1]</code> wird durch <code>[https://www.semantic-mediawiki.org/wiki/Help:$2 $2]</code> ersetzt.\";'),('de','messages:smw-admin-deprecation-notice-docu','s:250:\"In diesem Abschnitt werden Änderungen bezüglich Konfigurationsparametern angezeigt, die als veraltet gelten und/oder auf diesem Wiki aktiv konfiguriert sind. Die angegebenen Konfigurationsparameter werden mit künftigen Softwareversionen entfallen.\";'),('de','messages:smw-admin-deprecation-notice-title','s:46:\"Änderungshinweise zu Konfigurationsparametern\";'),('de','messages:smw-admin-deprecation-notice-title-notice','s:7:\"Hinweis\";'),('de','messages:smw-admin-deprecation-notice-title-removal','s:10:\"Entfernung\";'),('de','messages:smw-admin-deprecation-notice-title-replacement','s:9:\"Ersetzung\";'),('de','messages:smw-admin-docu','s:400:\"Diese Spezialseite bietet während Installation, Aktualisierung, Wartung und Nutzung sowie bei weiteren administrativen Funktionen und Aufgaben von <a href=\"https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki_–_Startseite\">Semantic MediaWiki</a> Unterstützung. Ebenso werden Statistiken bereitgestellt. Wichtige Daten sollten vor der Ausführung administrativer Funktionen gesichert werden.\";'),('de','messages:smw-admin-feature-disabled','s:209:\"Diese Funktion wurde auf diesem Wiki deaktiviert. Hierzu können Informationen auf der <a href=\"https://www.semantic-mediawiki.org/wiki/Help:$smwgAdminFeatures\">entsprechenden Hilfeseite</a> eingesehen werden.\";'),('de','messages:smw-admin-fulltext-active','s:98:\"Ein Auftrag zur Neuerstellung des Suchindexes für die Volltextsuche wurde erzeugt und eingeplant.\";'),('de','messages:smw-admin-fulltext-button','s:50:\"Auftrag zur Neuerstellung des Suchindexes erzeugen\";'),('de','messages:smw-admin-fulltext-intro','s:349:\"Erstellt den Suchindex der Attributtabellen mit einem für die [https://www.semantic-mediawiki.org/wiki/Full-text Volltextsuche] vorgesehenen Datentyp neu. Änderungen an den Indexregeln wie bspw. geänderte Stoppwörter, neuer Stemmer usw., und/oder das Hinzufügen oder Ändern einer Tabelle erfordern das erneute Ausführen dieser Spezialaufgabe.\";'),('de','messages:smw-admin-fulltext-title','s:37:\"Index der Volltextsuche neu erstellen\";'),('de','messages:smw-admin-iddispose-docu','s:343:\"Die Bereinigung einer Objektkennung wird nach der Bestätigung unbeschränkt durchgeführt, d. h. sie wird direkt aus der Datenbank entfernt. Diese Aktion sollte daher nur mit großer \'\'\'Vorsicht\'\'\' und nur nach Einsicht in die [https://www.semantic-mediawiki.org/wiki/Help:Object_ID_disposal entsprechende Dokumentation] durchgeführt werden.\";'),('de','messages:smw-admin-iddispose-done','s:60:\"Die Objektkennung „$1“ wurde aus der Datenbank entfernt.\";'),('de','messages:smw-admin-iddispose-references','s:95:\"{{PLURAL:$2|Tabelle|Tabellen}} mit mindestens einem aktiven Verweis zur Objektkennung „$1“.\";'),('de','messages:smw-admin-iddispose-title','s:26:\"Objektkennungen bereinigen\";'),('de','messages:smw-admin-idlookup-docu','s:268:\"Diese Seite gibt Informationen zu Objektkennungen aus, die jeweils ein semantisches Informationsobjekt (Seite, Subobjekt, Attribut, usw.) repräsentieren. Diese Objektkennungen sind nicht zu verwechseln mit den von MediaWiki verwendeten Seiten- oder Versionskennungen.\";'),('de','messages:smw-admin-idlookup-title','s:42:\"Informationen zu Objektkennungen ermitteln\";'),('de','messages:smw-admin-installfile','s:221:\"Sofern beim Installieren Probleme auftreten, könnten die in der Datei <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md\">„INSTALL“</a> enthaltenen Informationen weiterhelfen.\";'),('de','messages:smw-admin-job-scheduler-note','s:371:\"Die meisten Aktivitäten werden als Auftrag erzeugt und eingeplant, um zu einem späteren Zeitpunkt in zeitlichen Intervallen stapelweise ausgeführt zu werden. Es ist deshalb unerlässlich, dass der Websiteadministrator entweder entsprechend das Wartungsskript \"runJobs.php\" plant und verwaltet oder den Konfigurationsparameter <code>$wgRunJobsAsync</code> konfiguriert.\";'),('de','messages:smw-admin-objectid','s:14:\"Objektkennung:\";'),('de','messages:smw-admin-operational-statistics','s:248:\"Diese Seite zeigt Statistiken, die bezüglich der Nutzung oder zum Betrieb von Semantic MediaWiki ermittelt wurden. Eine erweiterte Übersicht wikispezifischer Statistiken ist auf der Spezialseite [[Special:Statistics|<b>Statistik</b>]] verfügbar.\";'),('de','messages:smw-admin-outdateddisposal-active','s:76:\"Ein Auftrag zur Bereinigung veralteter Objekte wurde erzeugt und eingeplant.\";'),('de','messages:smw-admin-outdateddisposal-button','s:32:\"Auftrag zur Bereinigung erzeugen\";'),('de','messages:smw-admin-outdateddisposal-intro','s:489:\"Einige Aktivitäten, wie bspw. das Ändern des Datentyps eines Attributs, das Löschen von Seiten oder das Korrigieren fehlerhafter Datenwerte, führen zu [https://www.semantic-mediawiki.org/wiki/Outdated_entities veralteten Datenobjekten]. Es ist empfehlenswert, diese periodisch in der Datenbank zu bereinigen. Es kann etwas dauern, bis der Auftrag zur Bereinigung ausgeführt und abgeschlossen ist. Dies ist davon abhängig, in welchem zeitlichen Intervall Aufträge ausgeführt werden.\";'),('de','messages:smw-admin-outdateddisposal-title','s:28:\"Veraltete Objekte bereinigen\";'),('de','messages:smw-admin-permission-missing','s:271:\"Der Zugriff auf diese Seite wurde aufgrund fehlender Berechtigungen verwehrt. Bitte lies die Hilfeseite zu den [https://www.semantic-mediawiki.org/wiki/Help:Permissions „Berechtigungen“], um Informationen bezüglich der hierfür notwendigen Einstellungen zu erhalten.\";'),('de','messages:smw-admin-permissionswarn','s:626:\"Sofern diese Aktion mit einem SQL-Fehler abbricht, könnte es sein, dass der Datenbankbenutzer, mit dem das Wiki auf die Datenbank zugreift (siehe die Datei „LocalSettings.php“), über keine ausreichenden Rechte verfügt.\nUm das Problem zu beheben, ist es notwendig, entweder dem Datenbankbenutzer zusätzliche Rechte zur Erstellung und Löschung von Datenbanktabellen einzuräumen, den Datenbankadministrator zeitweilig in die Datei „LocalSettings.php“ einzutragen, oder aber das Wartungsskript „setupStore.php“ zu nutzen, das von einem Serveradministrator mit Administrationsberechtigung ausgeführt werden kann.\";'),('de','messages:smw-admin-propertystatistics-active','s:73:\"Ein Auftrag zur Neuerstellung der Statistik wurde erzeugt und eingeplant.\";'),('de','messages:smw-admin-propertystatistics-button','s:50:\"Auftrag zur Neuerstellung der Statistiken erzeugen\";'),('de','messages:smw-admin-propertystatistics-intro','s:221:\"Erstellt die gesamten Statistiken zu Attributen neu und aktualisiert sowie korrigiert die [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count Anzahl zugeordneter Attributwerte] auf den Seiten der Attribute.\";'),('de','messages:smw-admin-propertystatistics-title','s:39:\"Statistiken zu Attributen neu erstellen\";'),('de','messages:smw-admin-questions','s:222:\"Im Fall von Fragen oder Anregungen kann man sich an den Diskussionen auf der <a href=\"https://sourceforge.net/p/semediawiki/mailman/semediawiki-user/\">Mailingliste für Benutzer von „Semantic MediaWiki“</a> beteiligen.\";'),('de','messages:smw-admin-settings-docu','s:312:\"Diese Seite zeigt eine Liste der Standardeinstellungen sowie der für dieses Wiki angepassten Einstellungen zur Konfiguration von Semantic MediaWiki an. Weitergehende Informationen sind auf der Hilfeseite zu den [https://www.semantic-mediawiki.org/wiki/Help:Configuration Konfigurationseinstellungen] verfügbar.\";'),('de','messages:smw-admin-setupsuccess','s:33:\"Die Datenbank wurde eingerichtet.\";'),('de','messages:smw-admin-smwhomepage','s:200:\"Die Dokumentation für die Nutzer von Semantic MediaWiki ist auf <b><a href=\"https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki_%E2%80%93_Startseite\">semantic-mediawiki.org</a></b> verfügbar.\";'),('de','messages:smw-admin-statistics-job-docu','s:334:\"Die Statistiken zu Aufträgen zeigen Informationen zu noch nicht ausgeführten Aufträgen an, die von Semantic MediaWiki geplant wurden. Die Anzahl der Aufträge kann geringfügig ungenau sein oder auch Fehlversuche enthalten. Weitere Informationen befinden sind in der [https://www.mediawiki.org/wiki/Manual:Job_queue Dokumentation].\";'),('de','messages:smw-admin-statistics-job-title','s:25:\"Statistiken zu Aufträgen\";'),('de','messages:smw-admin-statistics-querycache-disabled','s:174:\"Das [https://www.semantic-mediawiki.org/wiki/QueryCache Cachen von Abfragen] wurde für dieses Wiki nicht aktiviert. Daher sind keine diesbezüglichen Statistiken verfügbar.\";'),('de','messages:smw-admin-statistics-querycache-explain','s:1226:\"Die Statistiken zum Abfragencache enthalten veränderliche wie auch abgeleitete Daten, darunter:\n* Fehlversuche („<tt>misses</tt>“) – Die Zahl der direkten Abrufe von Abfrageergebnissen aus der Datenbank, da sie nicht im Cache verfügbar waren.\n* Löschungen („<tt>deletes</tt>“) – Die Zahl der Löschungen des Caches, entweder durch den Nutzer oder durch entsprechende Mechanismen der Software.\n* Treffer („<tt>hits</tt>“) – Die Zahl der Abrufe von Abfrageergebnissen aus dem Cache, da sie dort verfügbar waren, aufgeteilt nach auf Seiten eingebetteten Abfragen („<tt>embedded</tt>“) und nicht eingebetteten Abfragen („<tt>nonEmbedded</tt>“) auf der Spezialseite „Semantische Suche“ oder über die API.\n* Mittlere Antwortzeit für Abfrageergebnisse („<tt>medianRetrievalResponseTime</tt>“) – Die mittlere Antwortzeit für gecachte und nicht gecachte Abrufe von Abfrageergebnissen in Sekunden während des Erhebungszeitraums der Statistiken zum Abfragencache.\n* Kein Cache („<tt>noCache</tt>“) – Die Zahl der Abrufe von Abfrageergebnissen aus der Datenbank aufgrund entsprechender Vorgaben, d. h. durch die Nutzung der Abfrageoptionen <code>limit=0</code> oder <code>no-cache</code>.\";'),('de','messages:smw-admin-statistics-querycache-title','s:29:\"Statistiken zum Abfragencache\";'),('de','messages:smw-admin-supplementary-idlookup-intro','s:79:\"$1 – Bietet Funktionen zur Ermittlung und Löschung einzelner Objektkennungen\";'),('de','messages:smw-admin-supplementary-idlookup-title','s:35:\"Objektkennungen suchen und löschen\";'),('de','messages:smw-admin-supplementary-operational-statistics-intro','s:103:\"$1 – Zeigt zu Semantic MediaWiki verfügbare Statistiken (semantische Daten, Aufträge, Abfragecache)\";'),('de','messages:smw-admin-supplementary-operational-statistics-title','s:34:\"Statistiken zu Nutzung und Betrieb\";'),('de','messages:smw-admin-supplementary-section-intro','s:135:\"Einige der aufgelisteten Funktionen in diesem Abschnitt könnten nutzungsbeschränkt und deshalb auf diesem Wiki nicht verwendbar sein.\";'),('de','messages:smw-admin-supplementary-section-title','s:23:\"Zusätzliche Funktionen\";'),('de','messages:smw-admin-supplementary-settings-intro','s:103:\"$1 – Zeigt eine Liste der verfügbaren von Semantic MediaWiki verwendeten Konfigurationseinstellungen\";'),('de','messages:smw-admin-supplementary-settings-title','s:27:\"Konfigurationseinstellungen\";'),('de','messages:smw-admin-support','s:23:\"Unterstützung erhalten\";'),('de','messages:smw-admin-supportdocu','s:63:\"Verschiedene Hinweise helfen vielleicht im Fall eines Problems:\";'),('de','messages:smw-api-smwbrowse-invalid-parameters','s:59:\"Parameters format is invalid, expected a valid JSON format.\";'),('de','messages:smw-ask-delete','s:10:\"[Löschen]\";'),('de','messages:smw-ask-format-help-link','s:66:\"[https://www.semantic-mediawiki.org/wiki/Help:$1_format $1] format\";'),('de','messages:smw-ask-format-selection-help','s:59:\"Weitere Informationen sind auf der Hilfeseite $1 verfügbar\";'),('de','messages:smw-ask-otheroptions-collapsed-info','s:104:\"Bitte auf das kleine Plus-Symbol klicken, um sich die weiteren verfügbaren Optionen anzeigen zu lassen.\";'),('de','messages:smw-ask-otheroptions-info','s:190:\"Dieser Abschnitt enthält Optionen, mit denen die Ergebnisausgabe gesteuert werden kann. Die Beschreibungen der Ausgabeparameter werden angezeigt, wenn man die Maus über deren Namen führt.\";'),('de','messages:smw-ask-query-search-info','s:199:\"Die Abfrage <code><nowiki>$1</nowiki></code> wurde von der Datenbank {{PLURAL:$3|1=„$2“ (aus dem Cache)|„$2“ (aus dem Cache)|„$2“}} in {{PLURAL:$4|einer Sekunde|$4 Sekunden}} beantwortet.\";'),('de','messages:smw-ask-search','s:5:\"Suche\";'),('de','messages:smw-ask-sorting','s:10:\"Sortierung\";'),('de','messages:smw-browse-api-subject-serialization-invalid','s:52:\"Die Seite hat ein ungültiges Serialisierungsformat.\";'),('de','messages:smw-browse-from-backend','s:62:\"Die Informationen werden momentan aus der Datenbank abgerufen.\";'),('de','messages:smw-browse-intro','s:189:\"Mit dieser Spezialseite können die auf Seiten oder mit Subobjekten gespeicherten Daten und Informationen eingesehen werden. Bitte gib den Namen einer Seite ein, die eingesehen werden soll.\";'),('de','messages:smw-browse-invalid-subject','s:52:\"Die Validierung der Seite ergab den Fehler „$1“.\";'),('de','messages:smw-browse-js-disabled','s:345:\"JavaScript ist entweder deaktiviert oder nicht verfügbar. Es wird empfohlen, JavaScript zu aktivieren oder einen Browser zu nutzen, der JavaScript unterstützt. Weitere Optionen sind auf der Seite bezüglich des Konfigurationsparameters [https://www.semantic-mediawiki.org/wiki/Help:$smwgBrowseByApi <code>$smwgBrowseByApi</code>] dokumentiert.\";'),('de','messages:smw-browse-property-group-description','s:26:\"Property group description\";'),('de','messages:smw-browse-property-group-label','s:20:\"Property group label\";'),('de','messages:smw-browse-property-group-tit