eine ungültige URL.\";'),('de','messages:smw-datavalue-external-formatter-uri-missing-placeholder','s:102:\"Der für das Erstellen der URI notwendige Datenwert für den Platzhalter „$1“ ist nicht vorhanden.\";'),('de','messages:smw-datavalue-external-identifier-formatter-missing','s:108:\"Dem Attribut wurde keine [[Property:External formatter uri|Anweisung zur Generierung einer URI]] zugewiesen.\";'),('de','messages:smw-datavalue-feature-not-supported','s:83:\"Die Funktion „$1“ ist auf diesem Wiki deaktiviert oder wird nicht unterstützt.\";'),('de','messages:smw-datavalue-import-invalid-format','s:100:\"„$1“ ist keine gültige Zeichenfolge für dieses Schema. Sie muss in vier Teile gegliedert sein.\";'),('de','messages:smw-datavalue-import-invalid-value','s:127:\"„$1“ ist kein gültiges Format. Es muss dem Schema „Namensraum“:„Kennung“ (z.&nbsp;B. „foaf:name“) entsprechen.\";'),('de','messages:smw-datavalue-import-link','s:37:\"[[MediaWiki:Smw import $1|$1-Import]]\";'),('de','messages:smw-datavalue-import-missing-namespace-uri','s:139:\"Es wurde keine URI für den Namensraum „$1“ auf der Seite mit den Definitionen für den [[MediaWiki:Smw import $1|$1-Import]] gefunden.\";'),('de','messages:smw-datavalue-import-missing-type','s:104:\"Es wurde keine Definition des Datentyps für „$1“ im [[MediaWiki:Smw import $2|$2-Import]] gefunden.\";'),('de','messages:smw-datavalue-import-unknown-namespace','s:192:\"Der für den Import vorgesehene Namensraum „$1“ ist unbekannt. Es muss sichergestellt werden, dass die Einzelheiten zum OWL-Import auf der Seite [[MediaWiki:Smw import $1]] angegeben sind.\";'),('de','messages:smw-datavalue-invalid-number','s:33:\"„$1“ ist keine gültige Zahl.\";'),('de','messages:smw-datavalue-languagecode-invalid','s:41:\"„$1“ ist kein zulässiger Sprachcode.\";'),('de','messages:smw-datavalue-languagecode-missing','s:93:\"Zur Annotation „$1“ konnte kein Sprachcode festgestellt werden (z.&nbsp;B. „xyz@de“).\";'),('de','messages:smw-datavalue-monolingual-datait