'),('de','messages:smw-datavalue-stripmarker-parse-error','s:223:\"Der angegebene Wert „$1“ enthält [https://en.wikipedia.org/wiki/Help:Strip_markers „Strip markers“ (Markierungen für vom Softwareparser genutzte Platzhalter)] und kann deshalb nicht ausreichend verarbeitet werden.\";'),('de','messages:smw-datavalue-time-invalid','s:121:\"Der Datenwert „$1“ entspricht keiner gültigen Angabe für ein Datum oder einen Zeitpunkt. „$2“ wurde ausgegeben.\";'),('de','messages:smw-datavalue-time-invalid-ampm','s:113:\"Der Datenwert „$1“ enthält „$2“ als Stundenangabe, die für die 2-mal-12-Stunden-Zählung ungültig ist.\";'),('de','messages:smw-datavalue-time-invalid-date-components-common','s:76:\"Der Datenwert „$1“ enthält einige nicht interpretierbare Informationen.\";'),('de','messages:smw-datavalue-time-invalid-date-components-dash','s:125:\"Der Datenwert „$1“ enthält einen Gedankenstrich oder andere für die Interpretation der Datumsangabe ungültige Zeichen.\";'),('de','messages:smw-datavalue-time-invalid-date-components-empty','s:56:\"Der Datenwert „$1“ enthält nicht alle Bestandteile.\";'),('de','messages:smw-datavalue-time-invalid-date-components-sequence','s:99:\"Der Datenwert „$1“ enthält eine für die Interpretation einer Datumsangabe ungültige Sequenz.\";'),('de','messages:smw-datavalue-time-invalid-date-components-three','s:123:\"Der Datenwert „$1“ besteht aus mehr als den drei für die Interpretation der Datumsangabe erforderlichen Bestandteilen.\";'),('de','messages:smw-datavalue-time-invalid-jd','s:111:\"Der Datenwert „$1“ entspricht keiner gültigen Zahl für ein julianisches Datum. „$2“ wurde ausgegeben.\";'),('de','messages:smw-datavalue-time-invalid-offset-zone-usage','s:129:\"Der Datenwert „$1“ enthält eine Angabe zur Zeitverschiebung und einen Zeitzonenidentifikator, die nicht unterstützt werden.\";'),('de','messages:smw-datavalue-time-invalid-prehistoric','s:198:\"Der Datenwert „$1“ entspricht keiner gültigen Angabe für ein prähistorisches Datum. Es könnte bspw. mehr als nur eine Jahreszahl oder ein unzutreffendes Kalendermodell angegeben worden sein.\";'),('de','messages:smw-datavalue-time-invalid-values','s:90:\"Der Datenwert „$1“ enthält nicht interpretierbare Informationen in Form von „$2“.\";'),('de','messages:smw-datavalue-type-invalid-typeuri','s:64:\"Mit dem Typ „$1“ konnte keine gültige URI generiert werden.\";'),('de','messages:smw-datavalue-uniqueness-constraint-error','s:143:\"Das Attribut „$1“ erlaubt nur die einmalige Zuordnung des Datenwerts \'\'$2\'\'. Dieser Datenwert ist bereits auf der Seite „$3“ vorhanden.\";'),('de','messages:smw-datavalue-uniqueness-constraint-isknown','s:161:\"Das Attribut „$1“ erlaubt nur die einmalige Zuordnung eines Datenwerts auf einer Seite. Der Datenwert \'\'$2\'\' ist bereits auf dieser Seite „$3“ vorhanden.\";'),('de','messages:smw-datavalue-uri-invalid-scheme','s:46:\" \"$1\" has not been listed as valid URI scheme.\";'),('de','messages:smw-datavalue-wikipage-empty','s:185:\"Es ist kein Wert für den Titel einer Seite vorhanden (z.&nbsp;B. <code>[[SomeProperty::]], [[]]</code>) und kann somit nicht als Name oder Teil einer Abfragebedingung verwendet werden.\";'),('de','messages:smw-datavalue-wikipage-invalid-title','s:206:\"Der angegebene Wert „$1“ enthält für den Datentyp Seite ungültige Zeichen oder ist unvollständig. Er kann deshalb während einer Abfrage oder bei einer Annotation unerwartete Ergebnisse verursachen.\";'),('de','messages:smw-datavalue-wikipage-missing-fragment-context','s:100:\"„$1“ kann nicht als Wert für eine Seite ohne eine im Kontext vorhandene Seite verwendet werden.\";'),('de','messages:smw-datavalue-wikipage-property-invalid-title','s:229:\"Der für das Attribut „$1“ des Datentyps Seite angegebene Wert „$2“ enthält ungültige Zeichen oder ist unvollständig. Er kann deshalb während einer Abfrage oder bei einer Annotation unerwartete Ergebnisse verursachen.\";'),('de','messages:smw-desc','s:163:\"Ermöglicht es, das Wiki zugänglicher zu machen – für Menschen \'\'und\'\' Maschinen ([https://www.semantic-mediawiki.org/wiki/Help:Nutzeranleitung Dokumentation])\";'),('de','messages:smw-edit-protection','s:321:\"Diese Seite ist [[Property:Is edit protected|bearbeitungsgeschützt]], um unbeabsichtigte Veränderungen an Inhalten und Daten zu verhindern. Sie kann deshalb nur von Benutzern mit der hierfür notwendigen [https://www.semantic-mediawiki.org/wiki/Help:User_rights_and_user_groups Berechtigung] „$1“ bearbeitet werden.\";'),('de','messages:smw-edit-protection-auto-update','s:140:\"Semantic MediaWiki hat den Schutzstatus der Seite übereinstimmend mit dem Wert des Attributs „Ist bearbeitungsgeschützt“ aktualisiert.\";'),('de','messages:smw-edit-protection-disabled','s:194:\"Der Bearbeitungsschutz mit Hilfe einer Annotation wurde deaktiviert. Daher kann das Spezialattribut „$1“ nicht verwendet werden, um diese Seite vor unerwünschten Bearbeitungen zu schützen.\";'),('de','messages:smw-edit-protection-enabled','s:70:\"Diese Seite wurde mit Semantic MediaWiki vor Bearbeitungen geschützt.\";'),('de','messages:smw-editpage-annotation-disabled','s:122:\"Diese Seite kann nicht mit semantischen Annotationen versehen werden, da der Namensraum hierfür nicht konfiguriert wurde.\";');
INSERT INTO `l10n_cache` VALUES ('de','messages:smw-editpage-annotation-enabled','s:528:\"Diese Seite kann mit semantischen Annotationen in Form von bspw. <code><nowiki>[[</nowiki>Gehört zu::Dokumentation]]</code> versehen werden, um strukturierte wie abfragbare Inhalte zu erfassen. Ausführliche Hinweise zum [https://www.semantic-mediawiki.org/wiki/Help:Attribute_und_Datentypen#Attribute Einfügen von Annotationen] oder [https://www.semantic-mediawiki.org/wiki/Help:Eingebettete_Abfrage Erstellen von Abfragen] sind auf der Website zu Semantic MediaWiki verfügbar.<!--[[Is specified as::World Heritage Site]]-->\";'),('de','messages:smw-editpage-concept-annotation-enabled','s:217:\"Dieses Konzept kann mithilfe der Parserfunktion #concept erweitert werden. Für eine Beschreibung zur Verwendung von #concept, siehe die Hilfeseite zu [https://www.semantic-mediawiki.org/wiki/Help:Concepts Konzepten].\";'),('de','messages:smw-editpage-property-annotation-disabled','s:315:\"Dieses Attribut kann nicht mit einem Datentyp versehen werden, da dieser bereits systemseitig festgelegt ist (Spezialattribut). Ausführliche Hinweise zu [https://www.semantic-mediawiki.org/wiki/Help:Spezialattribute Spezialattributen] sind auf der Website zu Semantic MediaWiki verfügbar.<!--[[Has type::Page]]-->\";'),('de','messages:smw-editpage-property-annotation-enabled','s:569:\"Dieses Attribut kann noch mit einem Datentyp in Form von bspw. <code><nowiki>[[</nowiki>Datentyp::Seite]]</code> oder weiteren unterstützten Deklarationen, z. B. <code><nowiki>[[</nowiki>Unterattribut von::Dokumentation]]</code>, versehen werden. Ausführliche Hinweise zu [https://www.semantic-mediawiki.org/wiki/Help:Datentyp#Datentypen Datentypen] sowie eine [https://www.semantic-mediawiki.org/wiki/Help:Datentyp#Liste_der_Datentypen Liste der Datentypen] sind auf der Website zu Semantic MediaWiki verfügbar.<!--[[Has type::Page]], [[Subproperty of::dc:date]]-->\";'),('de','messages:smw-format-datatable-emptytable','s:35:\"Es sind keine Ergebnisse vorhanden.\";'),('de','messages:smw-format-datatable-first','s:5:\"Erste\";'),('de','messages:smw-format-datatable-info','s:87:\"Es werden die Ergebnisse _START_ bis _END_ von insgesamt _TOTAL_ Ergebnissen angezeigt.\";'),('de','messages:smw-format-datatable-infoempty','s:37:\"Es werden keine Ergebnisse angezeigt.\";'),('de','messages:smw-format-datatable-infofiltered','s:43:\"(aus insgesamt _MAX_ Ergebnissen gefiltert)\";'),('de','messages:smw-format-datatable-infothousands','s:1:\".\";'),('de','messages:smw-format-datatable-last','s:6:\"Letzte\";'),('de','messages:smw-format-datatable-lengthmenu','s:22:\"Zeige _MENU_ Einträge\";'),('de','messages:smw-format-datatable-loadingrecords','s:8:\"Lade …\";'),('de','messages:smw-format-datatable-next','s:8:\"Nächste\";'),('de','messages:smw-format-datatable-previous','s:9:\"Vorherige\";'),('de','messages:smw-format-datatable-processing','s:14:\"Verarbeite …\";'),('de','messages:smw-format-datatable-search','s:6:\"Suche:\";'),('de','messages:smw-format-datatable-sortascending','s:52:\": aktivieren, um die Spalte aufsteigend zu sortieren\";'),('de','messages:smw-format-datatable-sortdescending','s:51:\": aktivieren, um die Spalte absteigend zu sortieren\";'),('de','messages:smw-format-datatable-toolbar-export','s:6:\"Export\";'),('de','messages:smw-format-datatable-zerorecords','s:55:\"Es wurden keine übereinstimmenden Ergebnisse gefunden.\";'),('de','messages:smw-help','s:4:\"Help\";'),('de','messages:smw-info-par-icon','s:104:\"Das anzuzeigende Symbol, entweder „Info“ (<code>info<code>) oder „Warnung“(<code>warning</code>)\";'),('de','messages:smw-info-par-message','s:26:\"Die anzuzeigende Nachricht\";'),('de','messages:smw-label-feed-description','s:11:\"$2-Feed: $1\";'),('de','messages:smw-label-feed-link','s:3:\"RSS\";'),('de','messages:smw-limitreport-intext-parsertime','s:62:\"[SMW] Zeitverbrauch des Parsers für die direkten Annotationen\";'),('de','messages:smw-limitreport-intext-parsertime-value','s:33:\"$1 {{PLURAL:$1|Sekunde|Sekunden}}\";'),('de','messages:smw-limitreport-pagepurge-storeupdatetime','s:70:\"[SMW] Dauer der Datenbankaktualisierung (beim Leeren des Seitencaches)\";'),('de','messages:smw-limitreport-pagepurge-storeupdatetime-value','s:33:\"$1 {{PLURAL:$1|Sekunde|Sekunden}}\";'),('de','messages:smw-list-pager-filter','s:7:\"Filter:\";'),('de','messages:smw-livepreview-loading','s:8:\"Lade …\";'),('de','messages:smw-no-data-available','s:31:\"Es sind keine Daten verfügbar.\";'),('de','messages:smw-pa-property-predefined-common','s:317:\"Dieses Attribut ist softwareseitig fest definiert und auch bekannt als [https://www.semantic-mediawiki.org/wiki/Help:Spezialattribute Spezialattribut]. Es erfüllt eine besondere Funktion, kann aber wie jedes andere [https://www.semantic-mediawiki.org/wiki/Help:Attribut benutzerdefinierte Attribut] verwendet werden.\";'),('de','messages:smw-pa-property-predefined-default','s:33:\"„$1“ ist ein Spezialattribut.\";'),('de','messages:smw-pa-property-predefined-long_askde','s:357:\"Es handelt sich um einen numerischen Wert, der der Summe verschachtelter Unterabfragen, verarbeiteten Attributketten sowie vorhandenen Elementen zur Beschreibung einer Abfrage entspricht. Er wird durch den mit dem Konfigurationsparameter [https://www.semantic-mediawiki.org/wiki/Help:$smwgQMaxDepth <code>$smwgQMaxDepth</code>] angegebenen Wert beschränkt.\";'),('de','messages:smw-pa-property-predefined-long_askpa','s:161:\"Es ist Teil einer Sammlung von Spezialattributen, mit denen das [https://www.semantic-mediawiki.org/wiki/Help:Query_profiler Profil einer Abfrage] erstellt wird.\";'),('de','messages:smw-pa-property-predefined-long_edip','s:267:\"Jeder Benutzer darf dieses Attribut zu einer Seite hinzufügen und so den Bearbeitungsschutz festlegen. Indes dürfen hernach nur Benutzer mit einer entsprechenden Berechtigung die auf diese Weise geschützte Seite bearbeiten und den Bearbeitungsschutz ggf. aufheben.\";'),('de','messages:smw-pa-property-predefined-long_errc','s:186:\"Fehler werden in einem [https://www.semantic-mediawiki.org/wiki/Help:Container Container] gesammelt, der eine Referenz zu dem Attribut beinhalten kann, das die Diskrepanz verursacht hat.\";'),('de','messages:smw-pa-property-predefined-long_pefu','s:192:\"Die URI muss einen Platzhalter enthalten, damit [[Special:Types/External identifier|externe Identifikatoren]] korrekt zur Erstellung einer gültigen Referenzierung positioniert werden können.\";'),('de','messages:smw-pa-property-predefined-long_pvuc','s:198:\"Eindeutigkeit bedeutet, dass zwei Datenwerte für ein bestimmtes Attribut bei durchgeführten Annotationen nicht identisch sein dürfen. Jeder Verstoß dieser Anforderung wird als Fehler eingestuft.\";'),('de','messages:smw-pa-property-predefined-long_sobj','s:346:\"Ein Subobjekt erlaubt die Speicherung mehrerer Attribut-Datenwert-Zuweisungen (Annotationen), ähnlich dem Vorgehen auf einer regulären Wikiseite. Die Speicherung erfolgt dabei in einem anderen Objektraum als dem der Wikiseite selbst. Dieser Objektraum ist indes mit der entsprechenden Wikiseite, auf der sich das Subobjekt befindet, verknüpft.\";'),('de','messages:smw-pa-property-predefined_ask','s:297:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die Metainformationen einer Abfrage als [https://www.semantic-mediawiki.org/wiki/Subobject Subobjekt] speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_askde','s:239:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das über die Tiefe einer Abfrage informiert. Dieses Attribut wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_askdu','s:264:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die Dauer in Sekunden speichert, die die Abfrage zur Ausführung benötigt hat. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_askfo','s:254:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das den Namen des in einer Abfrage verwendeten Ergebnisformats speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_askpa','s:256:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die Parameter einer Abfrage speichert, die deren Ergebnis beeinflussen. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_asksc','s:272:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die alternative Quelle einer Abfrage enthält, bspw. die einer wikifremden Fernabfrage. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_asksi','s:252:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die Anzahl der von einer Abfrage verwendeten Bedingungen speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_askst','s:240:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die Bedingungen der Abfrage als Zeichenfolge speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_boo','s:318:\"„$1“ ist ein [[Special:Types/Boolean|Datentyp]] für Wahrheitswerte („wahr“ oder „falsch“). Er wird Attributen mit Hilfe eines von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] bereitgestellten, softwareseitig fest definierten Attributs (Spezialattribut), zugeordnet.\";'),('de','messages:smw-pa-property-predefined_cdat','s:236:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das das Datum der ersten Version einer Seite speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_dat','s:281:\"„$1“ ist ein [[Special:Types/Date|Datentyp]] für Datumswerte. Er wird Attributen mit Hilfe eines von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] bereitgestellten, softwareseitig fest definierten Attributs (Spezialattribut), zugeordnet.\";'),('de','messages:smw-pa-property-predefined_dtitle','s:258:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das einen eindeutigen Anzeigetitel zu einem Objekt speichert und ihm zuweist. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_edip','s:243:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das den Status des Bearbeitungsschutzes einer Seite speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_eid','s:279:\"„$1“ ist ein [[Special:Types/External identifier|Datentyp]] für Anweisungen zum Generieren einer URI sowie ein softwareseitig fest definiertes Attribut. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_errc','s:321:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das Fehler im Zusammenhang mit der Verarbeitung von Eingaben sowie bei fehlerhaften Attribut-Datenwert-Zuweisungen (Annotationen) speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_errp','s:462:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das fehlerhafte Attributwerte speichert. Fehlerhafte Attributwerte entsprechen entweder nicht dem [https://semantic-mediawiki.org/wiki/Help:Datentyp Datentyp] des Attributs oder sind nicht als [[Property:Allows value|zulässiger Wert]] für das Attribut definiert worden. Das Attribut wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_errt','s:347:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das Beschreibungen zu Fehlern enthält, die in Verbindung mit fehlerhaften Attribut-Datenwert-Zuweisungen (Annotationen) oder bei deren Verarbeitung aufgetreten sind. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_impo','s:311:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das den Zusammenhang mit einem [https://www.semantic-mediawiki.org/wiki/Help:Import_vocabulary importierten Vokabular] beschreibt. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_lcode','s:264:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das den einem Datenwert zugeordneten „BCP47“-formatierten Sprachcode speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_ledt','s:276:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die Benutzerseite des Benutzers speichert, der die letzte Version einer Seite erstellt hat. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_list','s:265:\"„$1“ ist ein softwareseitig fest definiertes Attribut zur Definition einer Attributliste in einem [[Special:Types/Record|Attributverbund]]. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_mdat','s:239:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das das Datum der letzten Änderung einer Seite speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_media','s:235:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das den Medientyp einer hochgeladenen Datei speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_mime','s:234:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das den MIME-Typ einer hochgeladenen Datei speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_newp','s:241:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das den Status speichert, ob eine Seite eine neue Seite ist. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_num','s:283:\"„$1“ ist ein [[Special:Types/Number|Datentyp]] für Zahlenwerte. Er wird Attributen mit Hilfe eines von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] bereitgestellten, softwareseitig fest definierten Attributs (Spezialattribut), zugeordnet.\";'),('de','messages:smw-pa-property-predefined_pdesc','s:250:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das es erlaubt, ein Attribut im Kontext einer Sprache zu beschreiben. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_pefu','s:263:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das Anweisungen zum Generieren einer URI zusammen mit einem Platzhalter speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_peid','s:240:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die externe Kennung zum Generieren einer URI speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_prec','s:318:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die [https://www.semantic-mediawiki.org/wiki/Help:Display_precision Anzeigegenauigkeit] für numerische Datentypen dezimal speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_pval','s:252:\"„$1“ ist ein softwareseitig fest definiertes Attribut, mit dem die für ein Attribut zulässigen Datenwerte festgelegt werden. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_pvali','s:278:\"„$1“ ist ein softwareseitig fest definiertes Attribut, mit dem ein Verweis auf eine Liste mit für ein Attribut zulässigen Datenwerten festgelegt wird. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_pvap','s:388:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das eine [[MediaWiki:Smw allows pattern|Musterreferenz]] speichert anhand derer Attributwertzuweisungen mit Hilfe [https://de.wikipedia.org/wiki/Regulärer_Ausdruck regulärer Ausdrücke] überprüft werden. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_pvuc','s:338:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das die Information speichert, ob eine bestimmte Attribut-Datenwert-Zuweisung (Annotation) im Wiki einzigartig sein muss oder gar nur einmalig erfolgen darf. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_qty','s:300:\"„$1“ ist ein [[Special:Types/Quantity|Datentyp]] für Datenwerte mit Maßangaben. Er wird Attributen mit Hilfe eines von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] bereitgestellten, softwareseitig fest definierten Attributs (Spezialattribut), zugeordnet.\";'),('de','messages:smw-pa-property-predefined_sobj','s:271:\"„$1“ ist ein softwareseitig fest definiertes Attribut und stellt einen [https://www.semantic-mediawiki.org/wiki/Help:Container Datenverbund] dar. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_text','s:234:\"„$1“ ist ein softwareseitig fest definiertes Attribut, das einen Text mit einer beliebigen Länge speichert. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_type','s:252:\"„$1“ ist ein softwareseitig fest definiertes Attribut, mit dem der [[Special:Types|Datentyp]] eines Attributs festgelegt wird. Es wird von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] zur Verfügung gestellt.\";'),('de','messages:smw-pa-property-predefined_uri','s:283:\"„$1“ ist ein [[Special:Types/URL|Datentyp]] für URI-/URL-Werte. Er wird Attributen mit Hilfe eines von [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] bereitgestellten, softwareseitig fest definierten Attributs (Spezialattribut), zugeordnet.\";'),('de','messages:smw-page-indicator-usage-count','s:136:\"Ungefähre [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count Anzahl zugeordneter Attributwerte]: {{PLURAL:$2|\'\'\'$2\'\'\'}}\";'),('de','messages:smw-paramdesc-category-delim','s:39:\"Das Trennzeichen für die Ergebniswerte\";'),('de','messages:smw-paramdesc-category-template','s:57:\"Die Vorlage, mit der die Objekte formatiert werden sollen\";'),('de','messages:smw-paramdesc-category-userparam','s:56:\"Der Parameter, der an die Vorlage übergeben werden soll\";'),('de','messages:smw-paramdesc-columns','s:104:\"Die Anzahl der Spalten, die für die Anzeige Suchergebnisse verwendet werden sollen (standardmäßig $1)\";'),('de','messages:smw-paramdesc-csv-sep','s:61:\"Das zur Abgrenzung der Ergebnisse zu verwendende Trennzeichen\";'),('de','messages:smw-paramdesc-default','s:68:\"Der anzuzeigende Text, sofern keine Abfrageergebnisse vorhanden sind\";'),('de','messages:smw-paramdesc-distribution','s:86:\"Die Anzahl der Vorkommen von Werten zählen und anzeigen, anstatt sie alle anzuzeigen.\";'),('de','messages:smw-paramdesc-distributionlimit','s:69:\"Die Anzahl der Vorkommen von Werten auf bestimmte Werte beschränken.\";'),('de','messages:smw-paramdesc-distributionsort','s:56:\"Die Werteverteilung nach Anzahl der Vorkommen sortieren.\";'),('de','messages:smw-paramdesc-dsv-filename','s:27:\"Der Name für die DSV-Datei\";'),('de','messages:smw-paramdesc-dsv-separator','s:61:\"Das zur Abgrenzung der Ergebnisse zu verwendende Trennzeichen\";'),('de','messages:smw-paramdesc-embedformat','s:54:\"Das zum Festlegen der Überschriften genutzte HTML-Tag\";'),('de','messages:smw-paramdesc-embedonly','s:46:\"Die Ergebniswerte ohne Überschriften anzeigen\";