lid-json-format','s:51:\"Der JSON-Parser hat den Fehler „$1“ ausgegeben.\";'),('de','messages:smw-parser-recursion-level-exceeded','s:196:\"The level of $1 recursions was exceeded during a parse process. It is suggested to validated the template structure, or if necessary adjust configuration parameter <code>$maxRecursionDepth</code>.\";'),('de','messages:smw-patternedit-protection','s:218:\"Diese Seite ist bearbeitungsgeschützt, um unbeabsichtigte Veränderungen an Inhalten zu verhindern. Sie kann deshalb nur von Benutzern mit der hierfür notwendigen Berechtigung „smw-patternedit“ bearbeitet werden.\";'),('de','messages:smw-personal-jobqueue-watchlist','s:19:\"Job queue watchlist\";'),('de','messages:smw-postproc-queryref','s:80:\"Diese Seite muss aufgrund erforderlicher Nachverarbeitungen aktualisiert werden.\";'),('de','messages:smw-prefs-ask-options-collapsed-default','s:60:\"Bereich mit den Ausgabeparametern standardmäßig einklappen\";'),('de','messages:smw-prefs-ask-options-tooltip-display','s:54:\"Beschreibung der Ausgabeparameter als Tooltip anzeigen\";'),('de','messages:smw-prefs-general-options-disable-editpage-info','s:84:\"Anzeige zusätzlicher Informationen während des Bearbeitens von Seiten deaktivieren\";'),('de','messages:smw-prefs-general-options-time-correction','s:145:\"Zeitkorrektur mithilfe der lokalen [[Special:Preferences#mw-prefsection-rendering|Einstellung zum Zeitunterschied]] für Spezialseiten aktivieren\";'),('de','messages:smw-prefs-intro-text','s:442:\"Die unten angegebenen Optionen werden von [https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki_–_Startseite Semantic MediaWiki] oder zugehörigen Programmerweiterungen bereitgestellt. Mit ihnen können verfügbare Funktionen individuellen Bedürfnissen angepasst werden. Weitere Informationen hierzu sind auf der Hilfeseite zu den [https://www.semantic-mediawiki.org/wiki/Help:Benutzereinstellungen Benutzereinstellungen] verfügbar.\";'),('de','messages:smw-printername-feed','s:15:\"Feed (RSS/Atom)\";'),('de','messages:smw-processing','s:13:\"Processing...\";'),('de','messages:smw-processingerrorlist-intro','s:337:\"Die folgende Liste bietet eine Übersicht über die Verarbeitungsfehler, die beim Nutzen von [https://www.semantic-mediawiki.org/wiki/Semantic_MediaWiki_–_Startseite Semantic MediaWiki] aufgetreten sind. Es wird empfohlen, diese Liste regelmäßig einzusehen und ungültige Attribut-Datenwert-Zuweisungen (Annotationen) zu korrigieren.\";'),('de','messages:smw-property-indicator-last-count-update','s:86:\"Ungefähre Anzahl der Datenwertzuordnungen zu diesem Attribut\nZuletzt aktualisiert: $1\";'),('de','messages:smw-property-indicator-type-info','s:87:\"{{PLURAL:$1|Von einem Benutzer festgelegtes Attribut|Vom System vorgegebenes Attribut}}\";'),('de','messages:smw-property-label-similarity-docu','s:800:\"Diese Spezialseite vergleicht die [https://www.semantic-mediawiki.org/wiki/Property_similarity syntaktische Ähnlichkeit], nicht aber die semantische Ähnlichkeit, zwischen zwei Attributbezeichnungen und gibt diese an. Diese Analyse kann beim Ermitteln von orthografisch falsch geschriebenen oder gleichwertigen Attributen helfen, die konzeptionell gleichbedeutend sind. Siehe auch die Spezialseite [[Special:Properties|„Attribute“]], um Konzeption und Nutzung der hier angegebenen Attribute weiter zu klären. Der Schwellenwert für die Analyse kann angepasst werden, um die Ähnlichkeits- und Distanzmaße entweder zu erweitern oder zu verringern. Zudem kann das Attribut [[Property:$1|„$1“]] dazu genutzt werden, um bestimmte Attribute von der hier durchgeführten Analyse auszuschließen.\";'),('de','messages:smw-property-label-similarity-intro','s:77:\"<u>$1</u> ermittelt Ähnlichkeiten zwischen vorhandenen Attributbezeichnungen\";'),('de','messages:smw-property-label-similarity-noresult','s:51:\"Den Auswahlkriterien entsprechend keine Ergebnisse.\";'),('de','messages:smw-property-label-similarity-threshold','s:14:\"Schwellenwert:\";'),('de','messages:smw-property-label-similarity-title','s:49:\"Bericht zur Ähnlichkeit von Attributbezeichungen\";'),('de','messages:smw-property-label-similarity-type','s:33:\"Bezeichner des Datentyps anzeigen\";'),('de','messages:smw-property-name-invalid','s:77:\"Das Attribut „$1“ kann nicht verwendet werden (ungültiger Attributname).\";'),('de','messages:smw-property-page-list-count','s:56:\"Showing $1 {{PLURAL:$1|page|pages}} using this property.\";'),('de','messages:smw-property-page-list-search-count','s:80:\"Showing $1 {{PLURAL:$1|page|pages}} using this property with a \"$2\" value match.\";'),('de','messages:smw-property-predefined-label-skey','s:7:\"Sortkey\";'),('de','messages:smw-property-predefined-ppgr','s:229:\"\"$1\" is a predefined property that identifies entities (mainly categories) that are used as grouping instance for properties and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('de','messages:smw-property-preferred-label-language-combination-exists','s:139:\"„$1“ kann nicht als bevorzugte Bezeichnung verwendet werden, da der Sprache „$2“ bereits die Bezeichnung „$3“ zugewiesen wurde.\";'),('de','messages:smw-property-preferred-title-format','s:7:\"$1 ($2)\";'),('de','messages:smw-property-req-violation-change-propagation-locked','s:640:\"Das Attribut „$1“ wurde dergestalt verändert, dass gleichzeitig ein [https://www.semantic-mediawiki.org/wiki/Change_propagation Datenänderungsvorgang] ausgelöst wurde. Daher ist die Seite des Attributs bis zu dem Zeitpunkt für Bearbeitungen gesperrt, an dem die primären Daten aktualisiert wurden. Hierdurch werden ggf. mögliche Funktionsstörungen oder widersprüchliche Datenanzeigen verhindert. Da der Datenänderungsvorgang abhängig vom Umfang sowie der Abarbeitungsfrequenz der [https://www.mediawiki.org/wiki/Manual:Job_queue Auftragswarteschlange] ist, kann es einen Moment dauern, bevor die Seite wieder freigegeben wird.\";'),('de','messages:smw-property-req-violation-change-propagation-pending','s:445:\"Es stehen noch Datenaktualisierungen aufgrund eines [https://www.semantic-mediawiki.org/wiki/Change_propagation Datenänderungsvorgangs] aus ([https://www.mediawiki.org/wiki/Manual:Job_queue ungefähr {{PLURAL:$1|ein Auftrag|$1 Aufträge}}]). Es wird daher empfohlen, mit Veränderungen an Attributen zu warten, bis der Vorgang abgeschlossen wurde. Damit werden ggf. mögliche Funktionsstörungen oder widersprüchliche Datenanzeigen verhindert.\";'),('de','messages:smw-property-req-violation-import-type','s:293:\"Es wurde ein Datentyp zugeordnet, der mit dem vom importierten Vokabular „$1“ für dieses Attribut definierten Datentyp nicht kompatibel ist. Es ist allgemein nicht erforderlich, einen Datentyp festzulegen, da diese Information aus der importierten Definition des Attributs abgerufen wird.\";'),('de','messages:smw-property-req-violation-missing-fields','s:173:\"Die Annotation des Attribut „$1“ ist aufgrund des zugewiesenen Datentyps „$2“ unvollständig. Das Spezialattribut <code>Hat Komponenten</code> wurde nicht angegeben.\";'),('de','messages:smw-property-req-violation-missing-formatter-uri','s:196:\"Die Annotation des Attributs „$1“ ist aufgrund des zugewiesenen Datentyps unvollständig. Das Spezialattribut „Formatierungsanweisung zur externen URI“ mit einem entsprechenden Wert fehlt.\";'),('de','messages:smw-property-req-violation-predefined-type','s:164:\"„$1“ ist ein softwareseitig fest definiertes Attribut. Ihm wurde der Datentyp „$2“ zugewiesen, der nicht mit dem Standardtyp dieses Attributs vereinbar ist.\";'),('de','messages:smw-property-reserved-category','s:8:\"Category\";'),('de','messages:smw-property-userdefined-fixedtable','s:411:\"„$1“ wurde als [https://www.semantic-mediawiki.org/wiki/Fixed_properties fest definiertes Attribut] erstellt und konfiguriert. Jede Änderung des zugewiesenen [https://www.semantic-mediawiki.org/wiki/Type_declaration Datentyps] erfordert zwingend entweder die Ausführung des Wartungsskripts \"setupStore.p