hrt.</strong>\nEine Aktualisierung geht normalerweise nur langsam voran, da die Daten lediglich in kleinen Schritten erneuert werden, und zwar jedes Mal, wenn ein Benutzer auf das Wiki zugreift.\nUm diese Aktualisierung schneller zu Ende zu führen, kann man das MediaWiki-Wartungsskript <code>runJobs.php</code> einsetzen. Mit dem Parameter <code>--maxjobs 1000</code> beschränkt man dabei die Anzahl der Aktualisierungsschritte, die in einem Durchgang durchgeführt werden, um Probleme bei der Nutzung des hierfür erforderlichen Arbeitsspeichers zu vermeiden.\nGeschätzter Fortschritt der laufenden Aktualisierung:\";'),('de','messages:smw_smwadmin_datarefreshstop','s:33:\"Diese Datenaktualisierung beenden\";'),('de','messages:smw_smwadmin_datarefreshstopconfirm','s:37:\"Ja, ich bin mir {{GENDER:$1|sicher}}.\";'),('de','messages:smw_smwadmin_return','s:21:\"Zurück zur Seite $1.\";'),('de','messages:smw_smwadmin_updatenotstarted','s:74:\"Es läuft bereits ein Aktualisierungsprozess.\nEs wird kein neuer begonnen.\";'),('de','messages:smw_smwadmin_updatenotstopped','s:182:\"Um den laufenden Aktualisierungsprozess vorzeitig zu beenden, muss das Kontrollkästchen markiert werden, um dadurch anzuzeigen, dass man sich diesbezüglich tatsächlich sicher ist.\";'),('de','messages:smw_smwadmin_updatestarted','s:253:\"Ein Aktualisierungsprozess zur Erneuerung der semantischen Daten wurde gestartet.\nAlle gespeicherten Daten werden, sofern notwendig, entweder neu erstellt oder repariert.\nDer Fortschritt der Aktualisierung kann auf dieser Spezialseite eingesehen werden.\";'),('de','messages:smw_smwadmin_updatestopped','s:64:\"Alle laufenden Aktualisierungsprozesse wurden vorzeitig beendet.\";'),('de','messages:smw_toomanyclosing','s:44:\"In der Abfrage kommen zu viele „$1“ vor.\";'),('de','messages:smw_true_words','s:11:\"wahr,w,ja,j\";'),('de','messages:smw_type_header','s:35:\"Attribute mit dem Datentyp „$1“\";'),('de','messages:smw_typearticlecount','s:85:\"Es {{PLURAL:$1|wird ein Attri