\";'),('de','messages:tsb-email-promoted-subject','s:46:\"Du bist jetzt ein Übersetzer auf {{SITENAME}}\";'),('de','messages:tsb-email-rejected-body','s:524:\"Hallo $1,\n\nvielen Dank für deinen Antrag auf Beförderung {{GENDER:$1|zum Übersetzer|zur Übersetzerin}} auf {{SITENAME}}. Ich bedauere, dich informieren zu müssen, dass ich deinen Antrag abgelehnt habe, da die Qualität deiner Übersetzungen nicht den Anforderungen entspricht.\n\nFalls du denkst, dass dein Antrag durch einen Fehler abgelehnt wurde, versuche, deinen Übersetzerantrag auf {{SITENAME}} erneut einzureichen. Du kannst dich hier registrieren:\n$2\n\n$3,\n{{GENDER:$3|Mitarbeiter|Mitarbeiterin}} von {{SITENAME}}\";'),('de','messages:tsb-email-rejected-subject','s:77:\"Dein Antrag auf Beförderung zum Übersetzer auf {{SITENAME}} wurde abgelehnt\";'),('de','messages:tsb-filter-pending','s:20:\"Ausstehende Anfragen\";'),('de','messages:tsb-limit-reached-body','s:191:\"Du hast das Übersetzungslimit für neue Übersetzer erreicht.\nUnser Team wird dein Benutzerkonto bald verifizieren und hochstufen.\nDu wirst dann in der Lage sein, ohne Limits zu übersetzen.\";'),('de','messages:tsb-limit-reached-title','s:31:\"Danke für deine Übersetzungen\";'),('de','messages:tsb-no-requests-from-new-users','s:34:\"Keine Anträge von neuen Benutzern\";'),('de','messages:tsb-older-requests','s:54:\"{{PLURAL:$1|Eine ältere Anfrage|$1 ältere Anfragen}}\";'),('de','messages:tsb-reject-all-button-label','s:13:\"Alle ablehnen\";'),('de','messages:tsb-reject-button-label','s:8:\"Ablehnen\";'),('de','messages:tsb-reject-confirmation','s:32:\"{{PLURAL:$1|Benutzer}} abgelehnt\";'),('de','messages:tsb-reminder-content-generic','s:291:\"Hallo $1,\n\nvielen Dank für die Registrierung auf {{SITENAME}}.\n\nWenn du deine Testübersetzungen vervollständigst, gewähren dir die Administratoren kurz danach vollen Übersetzungszugriff.\n\nKomm vorbei und mache hier einige weitere Übersetzungen:\n$2\n\n$3,\ndie Mitarbeiter von {{SITENAME}}\";'),('de',