-param-recreate','s:71:\"Override any errors about the page having been deleted in the meantime.\";'),('en','messages:apihelp-edit-param-redirect','s:32:\"Automatically resolve redirects.\";'),('en','messages:apihelp-edit-param-section','s:83:\"Section number. <kbd>0</kbd> for the top section, <kbd>new</kbd> for a new section.\";'),('en','messages:apihelp-edit-param-sectiontitle','s:28:\"The title for a new section.\";'),('en','messages:apihelp-edit-param-starttimestamp','s:242:\"Timestamp when the editing process began, used to detect edit conflicts. An appropriate value may be obtained using <var>[[Special:ApiHelp/main|curtimestamp]]</var> when beginning the edit process (e.g. when loading the page content to edit).\";'),('en','messages:apihelp-edit-param-summary','s:82:\"Edit summary. Also section title when $1section=new and $1sectiontitle is not set.\";'),('en','messages:apihelp-edit-param-tags','s:37:\"Change tags to apply to the revision.\";'),('en','messages:apihelp-edit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-edit-param-title','s:76:\"Title of the page to edit. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-edit-param-token','s:94:\"The token should always be sent as the last parameter, or at least after the $1text parameter.\";'),('en','messages:apihelp-edit-param-undo','s:69:\"Undo this revision. Overrides $1text, $1prependtext and $1appendtext.\";'),('en','messages:apihelp-edit-param-undoafter','s:79:\"Undo all revisions from $1undo to this one. If not set, just undo one revision.\";'),('en','messages:apihelp-edit-param-unwatch','s:50:\"Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-watch','s:45:\"Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-edit-summary','s:22:\"Create and edit pages.\";'),('en','messages:apihelp-emailuser-example-email','s:76:\"Send an email to user <kbd>WikiSysop</kbd> with the text <kbd>Content</kbd>.\";'),('en','messages:apihelp-emailuser-param-ccme','s:31:\"Send a copy of this mail to me.\";'),('en','messages:apihelp-emailuser-param-subject','s:15:\"Subject header.\";'),('en','messages:apihelp-emailuser-param-target','s:22:\"User to send email to.\";'),('en','messages:apihelp-emailuser-param-text','s:10:\"Mail body.\";'),('en','messages:apihelp-emailuser-summary','s:13:\"Email a user.\";'),('en','messages:apihelp-expandtemplates-example-simple','s:68:\"Expand the wikitext <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),('en','messages:apihelp-expandtemplates-param-generatexml','s:55:\"Generate XML parse tree (replaced by $1prop=parsetree).\";'),('en','messages:apihelp-expandtemplates-param-includecomments','s:47:\"Whether to include HTML comments in the output.\";'),('en','messages:apihelp-expandtemplates-param-prop','s:158:\"Which pieces of information to get.\n\nNote that if no values are selected, the result will contain the wikitext, but the output will be in a deprecated format.\";'),('en','messages:apihelp-expandtemplates-param-revid','s:84:\"Revision ID, for <code><nowiki>{{REVISIONID}}</nowiki></code> and similar variables.\";'),('en','messages:apihelp-expandtemplates-param-text','s:20:\"Wikitext to convert.\";'),('en','messages:apihelp-expandtemplates-param-title','s:14:\"Title of page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-categories','s:84:\"Any categories present in the input that are not represented in the wikitext output.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:203:\"Any ResourceLoader modules that parser functions have requested be added to the output. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:32:\"The XML parse tree of the input.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-properties','s:64:\"Page properties defined by expanded magic words in the wikitext.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:72:\"The maximum time after which caches of the result should be invalidated.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:82:\"Whether the output is volatile and should not be reused elsewhere within the page.\";'),('en','messages:apihelp-expandtemplates-paramvalue-prop-wikitext','s:22:\"The expanded wikitext.\";'),('en','messages:apihelp-expandtemplates-summary','s:38:\"Expands all templates within wikitext.\";'),('en','messages:apihelp-feedcontributions-example-simple','s:49:\"Return contributions for user <kbd>Example</kbd>.\";'),('en','messages:apihelp-feedcontributions-param-deletedonly','s:32:\"Show only deleted contributions.\";'),('en','messages:apihelp-feedcontributions-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedcontributions-param-hideminor','s:17:\"Hide minor edits.\";'),('en','messages:apihelp-feedcontributions-param-month','s:25:\"From month (and earlier).\";'),('en','messages:apihelp-feedcontributions-param-namespace','s:47:\"Which namespace to filter the contributions by.\";'),('en','messages:apihelp-feedcontributions-param-newonly','s:40:\"Only show edits that are page creations.\";'),('en','messages:apihelp-feedcontributions-param-showsizediff','s:43:\"Show the size difference between revisions.\";'),('en','messages:apihelp-feedcontributions-param-tagfilter','s:42:\"Filter contributions that