eason given for the block.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-timestamp','s:47:\"Adds the timestamp of when the block was given.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-user','s:38:\"Adds the username of the blocked user.\";'),('en','messages:apihelp-query+blocks-paramvalue-prop-userid','s:37:\"Adds the user ID of the blocked user.\";'),('en','messages:apihelp-query+blocks-summary','s:40:\"List all blocked users and IP addresses.\";'),('en','messages:apihelp-query+categories-example-generator','s:81:\"Get information about all categories used in the page <kbd>Albert Einstein</kbd>.\";'),('en','messages:apihelp-query+categories-example-simple','s:72:\"Get a list of categories the page <kbd>Albert Einstein</kbd> belongs to.\";'),('en','messages:apihelp-query+categories-param-categories','s:96:\"Only list these categories. Useful for checking whether a certain page is in a certain category.\";'),('en','messages:apihelp-query+categories-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+categories-param-limit','s:30:\"How many categories to return.\";'),('en','messages:apihelp-query+categories-param-prop','s:53:\"Which additional properties to get for each category:\";'),('en','messages:apihelp-query+categories-param-show','s:33:\"Which kind of categories to show.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-hidden','s:72:\"Tags categories that are hidden with <code>_&#95;HIDDENCAT_&#95;</code>.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-sortkey','s:96:\"Adds the sortkey (hexadecimal string) and sortkey prefix (human-readable part) for the category.\";'),('en','messages:apihelp-query+categories-paramvalue-prop-timestamp','s:46:\"Adds timestamp of when the category was added.\";'),('en','messages:apihelp-query+categories-summary','s:40:\"List all categories the pages belong to.\";'),('en','messages:apihelp-query+categoryinfo-example-simple','s:74:\"Get informat