aramvalue-prop-userid','s:42:\"Adds the user ID responsible for the edit.\";'),('en','messages:apihelp-query+recentchanges-summary','s:25:\"Enumerate recent changes.\";'),('en','messages:apihelp-query+redirects-example-generator','s:57:\"Get information about all redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-example-simple','s:45:\"Get a list of redirects to the [[Main Page]].\";'),('en','messages:apihelp-query+redirects-param-limit','s:29:\"How many redirects to return.\";'),('en','messages:apihelp-query+redirects-param-namespace','s:39:\"Only include pages in these namespaces.\";'),('en','messages:apihelp-query+redirects-param-prop','s:24:\"Which properties to get:\";'),('en','messages:apihelp-query+redirects-param-show','s:139:\"Show only items that meet these criteria:\n;fragment:Only show redirects with a fragment.\n;!fragment:Only show redirects without a fragment.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-fragment','s:34:\"Fragment of each redirect, if any.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-pageid','s:25:\"Page ID of each redirect.\";'),('en','messages:apihelp-query+redirects-paramvalue-prop-title','s:23:\"Title of each redirect.\";'),('en','messages:apihelp-query+redirects-summary','s:41:\"Returns all redirects to the given pages.\";'),('en','messages:apihelp-query+revisions+base-param-contentformat','s:89:\"Serialization format used for <var>$1difftotext</var> and expected for output of content.\";'),('en','messages:apihelp-query+revisions+base-param-diffto','s:218:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Revision ID to diff each revision to. Use <kbd>prev</kbd>, <kbd>next</kbd> and <kbd>cur</kbd> for the previous, next and current revision respectively.\";'),('en','messages:apihelp-query+revisions+base-param-difftotext','s:254:\"Use <kbd>[[Special:ApiHelp/compare|action=compare]]</kbd> instead. Text to diff each revision to. Only diffs a limited number 