admin-deprecation-notice-title-replacement','s:11:\"Replacement\";'),('en','messages:smw-admin-docu','s:311:\"This special page helps you during installation, upgrade, maintenance and usage of <a href=\"https://www.semantic-mediawiki.org\">Semantic MediaWiki</a> and also provides further administrative functions and tasks as well as statistics.\nRemember to back up valuable data before executing administrative functions.\";'),('en','messages:smw-admin-feature-disabled','s:197:\"This feature has been disabled on this wiki, please consult the <a href=\"https://www.semantic-mediawiki.org/wiki/Help:$smwgAdminFeatures\">settings</a> help page or contact the system administrator.\";'),('en','messages:smw-admin-fulltext-active','s:47:\"A full-text search rebuild job has been queued.\";'),('en','messages:smw-admin-fulltext-button','s:26:\"Schedule full-text rebuild\";'),('en','messages:smw-admin-fulltext-intro','s:280:\"Rebuilds the search index from property tables with an enabled [https://www.semantic-mediawiki.org/wiki/Full-text full-text search] datatype. Changes to the index rules (altered stopwords, new stemmer etc.) and/or a newly added or altered table does require to run this job again.\";'),('en','messages:smw-admin-fulltext-title','s:24:\"Full-text search rebuild\";'),('en','messages:smw-admin-iddispose-docu','s:278:\"The disposal operation is unrestricted and will remove an internal object ID from the storage engine, if confirmed. Please perform this task with \'\'\'caution\'\'\' and only after the [https://www.semantic-mediawiki.org/wiki/Help:Object_ID_disposal documentation] has been consulted.\";'),('en','messages:smw-admin-iddispose-done','s:45:\"ID \"$1\" was removed from the storage backend.\";'),('en','messages:smw-admin-iddispose-references','s:73:\"{{PLURAL:$2|Table|Tables}} with at least one active reference to ID \"$1\".\";'),('en','messages:smw-admin-iddispose-title','s:18:\"Object ID disposal\";'),('en','messages:smw-admin-idlookup-docu','s:221:\"Request details about an internal object ID that represents an individual entity (wikipage, subobject, property etc.) in Semantic MediaWiki. The ID should not be mistaken to be the same as MediaWiki\'s page or revision ID.\";'),('en','messages:smw-admin-idlookup-title','s:16:\"Object ID lookup\";'),('en','messages:smw-admin-installfile','s:201:\"If you experience problems with your installation, start by checking the guidelines in the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md\">INSTALL file</a>.\";'),('en','messages:smw-admin-job-scheduler-note','s:274:\"Most activities are scheduled as job in order for tasks to be performed as batch with the job scheduler to plan and complete the processing therefore it is critical that the maintenance script <code>runJobs.php</code> or <code>$wgRunJobsAsync</code> are managed accordingly.\";'),('en','messages:smw-admin-objectid','s:10:\"Object ID:\";'),('en','messages:smw-admin-operational-statistics','s:194:\"This page contains operational statistics collected in or from Semantic MediaWiki related functions. An extended list of wiki specific statistics can be found [[Special:Statistics|<b>here</b>]].\";'),('en','messages:smw-admin-outdateddisposal-active','s:50:\"An outdated entities disposal job has been queued.\";'),('en','messages:smw-admin-outdateddisposal-button','s:17:\"Schedule disposal\";'),('en','messages:smw-admin-outdateddisposal-intro','s:279:\"Some activities (a change to a property type, the removal of wikipages, or the correction of error values) will result in [https://www.semantic-mediawiki.org/wiki/Outdated_entities outdated entities] and it is suggested to remove them periodically to free associated table space.\";'),('en','messages:smw-admin-outdateddisposal-title','s:26:\"Outdated entities disposal\";'),('en','messages:smw-admin-permission-missing','s:210:\"The access to this page has been blocked due to missing permissions, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Permissions permissions] help page for details about the necessary settings.\";'),('en','messages:smw-admin-permissionswarn','s:432:\"If the operation fails with SQL errors, the database user employed by your wiki (check your \"LocalSettings.php\" file) probably does not have sufficient permissions.\nEither grant this user additional permissions to create and delete tables, temporarily enter the login of your database root in the \"LocalSettings.php\" file, or use the maintenance script <code>setupStore.php</code>, which can use the credentials of an administrator.\";'),('en','messages:smw-admin-propertystatistics-active','s:41:\"A statistics rebuild job has been queued.\";'),('en','messages:smw-admin-propertystatistics-button','s:27:\"Schedule statistics rebuild\";'),('en','messages:smw-admin-propertystatistics-intro','s:177:\"Rebuilds the entire property usage statistics and therein updates and corrects the [https://www.semantic-mediawiki.org/wiki/Help:Property_usage_count usage count] of properties.\";'),('en','messages:smw-admin-propertystatistics-title','s:27:\"Property statistics rebuild\";'),('en','messages:smw-admin-questions','s:184:\"If you have further questions or suggestions, join the discussion on <a href=\"https://sourceforge.net/p/semediawiki/mailman/semediawiki-user/\">Semantic MediaWiki user mailing list</a>.\";'),('en','messages:smw-admin-settings-docu','s:251:\"Displays a list of all default and localized settings that are relevant to the Semantic MediaWiki environment. For details on individual settings, please consult the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-admin-setupsuccess','s:30:\"The storage engine was set up.\";'),('en','messages:smw-admin-smwhomepage','s:139:\"The complete user documentation to Semantic MediaWiki is at <b><a href=\"https://www.semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),('en','messages:smw-admin-statistics-job-docu','s:288:\"The job statistics displays information about scheduled Semantic MediaWiki jobs that have not yet been executed. The number of jobs may be slightly inaccurate or contains failed attempts, please consult the [https://www.mediawiki.org/wiki/Manual:Job_queue manual] for further information.\";'),('en','messages:smw-admin-statistics-job-title','s:14:\"Job statistics\";'),('en','messages:smw-admin-statistics-querycache-disabled','s:141:\"The [https://www.semantic-mediawiki.org/wiki/QueryCache QueryCache] has not been enabled on this wiki and hereby no statistics are available.\";'),('en','messages:smw-admin-statistics-querycache-explain','s:869:\"The cache statistics is to contain provisional cumulative as well as derived data including: \n* \"misses\" as the total attempts to retrieve data from the cache with unattainable responses, forcing a direct repository (DB, triple-store etc.) retrieval \n* \"deletes\" as the total amount of cache eviction operations (either through a purge or query dependency) \n* \"hits\" contains the amount of cache retrievals from either embedded (queries called from within a wiki page) or non-embedded (if enabled, requested by pages like Special:Ask or the API) sources \n* \"medianRetrievalResponseTime\" is an orientation value of the median response time (in sec.) for cached and non-cached retrieval requests over the time span of the collection process  \n* \"noCache\" indicates the amount of no attempt requests (limit=0 queries, \'no-cache\' option etc.) to retrieve results from cache\";'),('en','messages:smw-admin-statistics-querycache-title','s:22:\"Query cache statistics\";'),('en','messages:smw-admin-supplementary-idlookup-intro','s:66:\"<u>$1</u> contains functions to lookup and dispose individual ID\'s\";'),('en','messages:smw-admin-supplementary-idlookup-title','s:29:\"Object ID lookup and disposal\";'),('en','messages:smw-admin-supplementary-operational-statistics-intro','s:48:\"<u>$1</u> displays an extended set of statistics\";'),('en','messages:smw-admin-supplementary-operational-statistics-title','s:22:\"Operational statistics\";'),('en','messages:smw-admin-supplementary-section-intro','s:107:\"Some of the listed functions in this section may be restricted and therefore are inaccessible on this wiki.\";'),('en','messages:smw-admin-supplementary-section-title','s:23:\"Supplementary functions\";'),('en','messages:smw-admin-supplementary-settings-intro','s:84:\"<u>$1</u> outputs a collective list of available settings used in Semantic MediaWiki\";'),('en','messages:smw-admin-supplementary-settings-title','s:22:\"Configuration settings\";'),('en','messages:smw-admin-support','s:15:\"Getting support\";'),('en','messages:smw-admin-supportdocu','s:53:\"Various resources might help you in case of problems:\";'),('en','messages:smw-api-smwbrowse-invalid-parameters','s:59:\"Parameters format is invalid, expected a valid JSON format.\";'),('en','messages:smw-ask-delete','s:8:\"[Delete]\";'),('en','messages:smw-ask-format-help-link','s:66:\"[https://www.semantic-mediawiki.org/wiki/Help:$1_format $1] format\";'),('en','messages:smw-ask-format-selection-help','s:58:\"For a detailed description, please visit the $1 help page.\";'),('en','messages:smw-ask-otheroptions-collapsed-info','s:54:\"Please use the plus icon to view all available options\";'),('en','messages:smw-ask-otheroptions-info','s:121:\"This section contains options that alter printout statements. Parameter descriptions can be viewed by hovering over them.\";'),('en','messages:smw-ask-query-search-info','s:188:\"The query <code><nowiki>$1</nowiki></code> was answered by the {{PLURAL:$3|1=<code>$2</code> (from cache)|<code>$2</code> (from cache)|<code>$2</code>}} in $4 {{PLURAL:$4|second|seconds}}.\";'),('en','messages:smw-ask-search','s:6:\"Search\";'),('en','messages:smw-ask-sorting','s:7:\"Sorting\";'),('en','messages:smw-browse-api-subject-serialization-invalid','s:48:\"The subject has an invalid serialization f