96:\"The [[Special:Types/Reference|Reference]] type expects a list of properties to be declared using the [https://www.semantic-mediawiki.org/wiki/Help:Special_property_Has_fields Has fields] property.\";'),('en','messages:smw-datavalue-reference-outputformat','s:6:\"$1: $2\";'),('en','messages:smw-datavalue-restricted-use','s:50:\"Datavalue \"$1\" has been marked for restricted use.\";'),('en','messages:smw-datavalue-stripmarker-parse-error','s:142:\"The given value \"$1\" contains [https://en.wikipedia.org/wiki/Help:Strip_markers strip markers] and therefore it cannot be parsed sufficiently.\";'),('en','messages:smw-datavalue-time-invalid','s:98:\"Unable to interpret the \"$1\" input value as valid date or time component with \"$2\" being reported.\";'),('en','messages:smw-datavalue-time-invalid-ampm','s:76:\"\"$1\" contains \"$2\" as hour element that is invalid for a 12-hour convention.\";'),('en','messages:smw-datavalue-time-invalid-date-components-common','s:47:\"\"$1\" contains some uninterpretable information.\";'),('en','messages:smw-datavalue-time-invalid-date-components-dash','s:95:\"\"$1\" contains an extrinsic dash or other characters that are invalid for a date interpretation.\";'),('en','messages:smw-datavalue-time-invalid-date-components-empty','s:36:\"\"$1\" contains some empty components.\";'),('en','messages:smw-datavalue-time-invalid-date-components-sequence','s:109:\"\"$1\" contains a sequence that could not be interpreted against an available match matrix for date components.\";'),('en','messages:smw-datavalue-time-invalid-date-components-three','s:76:\"\"$1\" contains more than three components required for a date interpretation.\";'),('en','messages:smw-datavalue-time-invalid-jd','s:98:\"Unable to interpret the \"$1\" input value as valid JD (Julian day) number with \"$2\" being reported.\";'),('en','messages:smw-datavalue-time-invalid-offset-zone-usage','s:67:\"\"$1\" contains an offset and zone identifier which is not supported.\";'),('en','messages:smw-datavalue-time-invalid-prehistoric','s:173:\"Unable to interpret a prehistoric \"$1\" input value. For example, having specified more than years or a calendar model may return unexpected results in a prehistoric context.\";'),('en','messages:smw-datavalue-time-invalid-values','s:68:\"The \"$1\" value contains uninterpretable information in form of \"$2\".\";'),('en','messages:smw-datavalue-type-invalid-typeuri','s:71:\"The \"$1\" type could not be transformed into a valid URI representation.\";'),('en','messages:smw-datavalue-uniqueness-constraint-error','s:101:\"Property \"$1\" only permits unique value assignments and \'\'$2\'\' was already annotated in subject \"$3\".\";'),('en','messages:smw-datavalue-uniqueness-constraint-isknown','s:94:\"Property \"$1\" only permits unique value annotations, \'\'$2\'\' has already been assigned to \"$3\".\";'),('en','messages:smw-datavalue-uri-invalid-scheme','s:46:\" \"$1\" has not been listed as valid URI scheme.\";'),('en','messages:smw-datavalue-wikipage-empty','s:153:\"The wikipage input value is empty (e.g. <code>[[SomeProperty::]], [[]]</code>) and therefore it cannot be used as a name or as part of a query condition.\";'),('en','messages:smw-datavalue-wikipage-invalid-title','s:156:\"The page type input value \"$1\" contains invalid characters or is incomplete and therefore can cause unexpected results during a query or annotation process.\";'),('en','messages:smw-datavalue-wikipage-missing-fragment-context','s:68:\"The wikipage input value \"$1\" cannot be used without a context page.\";'),('en','messages:smw-datavalue-wikipage-property-invalid-title','s:176:\"Property \"$1\" (as page type) with input value \"$2\" contains invalid characters or is incomplete and therefore can cause unexpected results during a query or annotation process.\";'),('en','messages:smw-desc','s:144:\"Making your wiki more accessible - for machines \'\'and\'\' humans ([https://www.semantic-mediawiki.org/wiki/Help:User_manual online documentation])\";'),('en','messages:smw-edit-protection','s:243:\"This page is [[Property:Is edit protected|protected]] to prevent accidental data modification and therefore can only be edited by users with the appropriate \"$1\" [https://www.semantic-mediawiki.org/wiki/Help:User_rights_and_user_groups right].\";'),('en','messages:smw-edit-protection-auto-update','s:99:\"Semantic MediaWiki has updated the protection status according to the \"Is edit protected\" property.\";'),('en','messages:smw-edit-protection-disabled','s:118:\"The edit protection has been disabled therefore \"$1\" cannot be used to protect entity pages from unauthorized editing.\";'),('en','messages:smw-edit-protection-enabled','s:35:\"Edit protected (Semantic MediaWiki)\";'),('en','messages:smw-editpage-annotation-disabled','s:236:\"This page is not enabled for semantic in-text annotations due to namespace restrictions. Details about how to enable the namespace can be found on the [https://www.semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),('en','messages:smw-editpage-annotation-enabled','s:559:\"This page supports semantic in-text annotations (e.g. <nowiki>\"[[Is specified as::World Heritage Site]]\"</nowiki>) to build structured and queryable content provided by Semantic MediaWiki. For a comprehensive description on how to use annotations or the #ask parser function, please have a look at the [https://www.semantic-mediawiki.org/wiki/Help:Getting_started getting started], [https://www.semantic-mediawiki.org/wiki/Help:In-text_annotation in-text annotation], or [https://www.semantic-mediawiki.org/wiki/Help:Inline_queries inline queries] help pages.\";'),('en','messages:smw-editpage-concept-annotation-enabled','s:189:\"This concept can be extended using the #concept parser function. For a description on how to use #concept, see the [https://www.semantic-mediawiki.org/wiki/Help:Concepts concept] help page.\";'),('en','messages:smw-editpage-property-annotation-disabled','s:259:\"This property cannot be extended with a datatype annotation (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) as it is already predefined (see the [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special properties] help page for more information).\";'),('en','messages:smw-editpage-property-annotation-enabled','s:472:\"This property can be extended using semantic annotations to specify a datatype (e.g. <nowiki>\"[[Has type::Page]]\"</nowiki>) or other supporting declarations (e.g. <nowiki>\"[[Subproperty of::dc:date]]\"</nowiki>). For a description on how to augment this page, see the [https://www.semantic-mediawiki.org/wiki/Help:Property_declaration declaration of a property] or the [https://www.semantic-mediawiki.org/wiki/Help:List_of_datatypes list of available data types] help page.\";'),('en','messages:smw-format-datatable-emptytable','s:26:\"No data available in table\";'),('en','messages:smw-format-datatable-first','s:5:\"First\";'),('en','messages:smw-format-datatable-info','s:43:\"Showing _START_ to _END_ of _TOTAL_ entries\";'),('en','messages:smw-format-datatable-infoempty','s:27:\"Showing 0 to 0 of 0 entries\";'),('en','messages:smw-format-datatable-infofiltered','s:35:\"(filtered from _MAX_ total entries)\";'),('en','messages:smw-format-datatable-infothousands','s:1:\",\";'),('en','messages:smw-format-datatable-last','s:4:\"Last\";'),('en','messages:smw-format-datatable-lengthmenu','s:19:\"Show _MENU_ entries\";'),('en','messages:smw-format-datatable-loadingrecords','s:10:\"Loading...\";'),('en','messages:smw-format-datatable-next','s:4:\"Next\";'),('en','messages:smw-format-datatable-previous','s:8:\"Previous\";'),('en','messages:smw-format-datatable-processing','s:13:\"Processing...\";'),('en','messages:smw-format-datatable-search','s:7:\"Search:\";'),('en','messages:smw-format-datatable-sortascending','s:35:\": activate to sort column ascending\";'),('en','messages:smw-format-datatable-sortdescending','s:36:\": activate to sort column descending\";'),('en','messages:smw-format-datatable-toolbar-export','s:6:\"Export\";'),('en','messages:smw-format-datatable-zerorecords','s:25:\"No matching records found\";'),('en','messages:smw-help','s:4:\"Help\";'),('en','messages:smw-info-par-icon','s:41:\"Icon to show, either \"info\" or \"warning\".\";'),('en','messages:smw-info-par-message','s:19:\"Message to display.\";'),('en','messages:smw-label-feed-description','s:10:\"$1 $2 feed\";'),('en','messages:smw-label-feed-link','s:3:\"RSS\";'),('en','messages:smw-limitreport-intext-parsertime','s:36:\"[SMW] In-text annotation parser time\";'),('en','messages:smw-limitreport-intext-parsertime-value','s:31:\"$1 {{PLURAL:$1|second|seconds}}\";'),('en','messages:smw-limitreport-pagepurge-storeupdatetime','s:39:\"[SMW] Store update time (on page purge)\";'),('en','messages:smw-limitreport-pagepurge-storeupdatetime-value','s:31:\"$1 {{PLURAL:$1|second|seconds}}\";'),('en','messages:smw-list-pager-filter','s:7:\"Filter:\";'),('en','messages:smw-livepreview-loading','s:10:\"Loading...\";'),('en','messages:smw-no-data-available','s:18:\"No data available.\";'),('en','messages:smw-pa-property-predefined-common','s:290:\"This property is pre-deployed (also known as [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special property]) and comes with additional administrative privileges but can be used just like any other [https://www.semantic-mediawiki.org/wiki/Property user-defined property].\";'),('en','messages:smw-pa-property-predefined-default','s:30:\"\"$1\" is a predefined property.\";'),('en','messages:smw-pa-property-predefined-long_askde','s:271:\"It is a numerical value computed on the basis of subquery nesting, property chains, and available description elements with the execution of a query being restricted by the <code>[https://www.semantic-mediawiki.org/wiki/Help:$smwgQMaxDepth $smwgQMaxDepth]</code> setting.\";'),('en','messages:smw-pa-property-predefined-long_askpa','s:132:\"It is part of a collection of properties that specify a [https://www.semantic-mediawiki.org/wiki/Help:Query_profiler query profile].\";'),('en','messages:smw-pa-property-predefined-long_edip','s:174:\"While any user is qualified to add this property to a subject, only a user with a dedicated permission can edit or revoke the protection to an entity after it has been added.\";'),('en','messages:smw-pa-property-predefined-long_errc','s:166:\"Errors are collected in a [https://www.semantic-mediawiki.org/wiki/Help:Container container] that may include a reference to the property that caused the discrepancy.\";'),('en','messages:smw-pa-property-predefined-long_pefu','s:174:\"The URI is expected to contain a placeholder that will be adjusted with an [[Special:Types/External identifier|external identifier]] value to form a valid resource reference.\";'),('en','messages:smw-pa-property-predefined-long_pvuc','s:154:\"Uniqueness is established when two values are not equal in their literal representation and any violation of that constraint will be categorized as error.\";'),('en','messages:smw-pa-property-predefined-long_sobj','s:180:\"The container allows to accumulate property-value assignments similar to that of a normal wiki page but within a different entity space while being linked to the embedding subject.\";'),('en','messages:smw-pa-property-predefined_ask','s:269:\"\"$1\" is a predefined property that represents meta information (in form of a [https://www.semantic-mediawiki.org/wiki/Subobject subobject]) about individual queries and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askde','s:174:\"\"$1\" is a predefined property that informs about the depth of a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askdu','s:221:\"\"$1\" is a predefined property containing a time value (in seconds) that was required to complete the query execution and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askfo','s:191:\"\"$1\" is a predefined property that holds the name of the result format used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askpa','s:186:\"\"$1\" is a predefined property describing parameters that influence a query result and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_asksc','s:183:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] that identifies alternative (e.g. remote) query sources.\";'),('en','messages:smw-pa-property-predefined_asksi','s:189:\"\"$1\" is a predefined property that collects the number of conditions used in a query and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_askst','s:189:\"\"$1\" is a predefined property that describes the conditions of the query as a string and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_boo','s:190:\"\"$1\" is a [[Special:Types/Boolean|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent boolean values.\";'),('en','messages:smw-pa-property-predefined_cdat','s:198:\"\"$1\" is a predefined property that corresponds to the date of the first revision of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_dat','s:184:\"\"$1\" is a [[Special:Types/Date|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent date values.\";'),('en','messages:smw-pa-property-predefined_dtitle','s:188:\"\"$1\" is a predefined property that can assign a distinct display title to an entity and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_edip','s:175:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to indicate whether editing is protected or not.\";'),('en','messages:smw-pa-property-predefined_eid','s:208:\"\"$1\" is a [[Special:Types/External identifier|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent external identifiers.\";'),('en','messages:smw-pa-property-predefined_errc','s:229:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] and represents errors that appeared in connection with improper value annotations or input processing.\";'),('en','messages:smw-pa-property-predefined_errp','s:275:\"\"$1\" is a predefined property to track input errors for irregular value annotations that was likely caused by type or [[Property:Allows value|allowed value]] restrictions and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_errt','s:179:\"\"$1\" is a predefined property containing a textual description of an error and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_impo','s:251:\"\"$1\" is a predefined property that describes a relation to an [https://www.semantic-mediawiki.org/wiki/Help:Import_vocabulary imported vocabulary] and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_lcode','s:182:\"\"$1\" is a predefined property that represents a BCP47 formatted language code and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_ledt','s:204:\"\"$1\" is a predefined property that contains the page name of the user who created the last revision and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_list','s:224:\"\"$1\" is a predefined property to define a list of properties used with a [[Special:Types/Record|record]] typed property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_mdat','s:201:\"\"$1\" is a predefined property that corresponds to the date of the last modification of a subject and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_media','s:184:\"\"$1\" is a predefined property that describes the media type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_mime','s:183:\"\"$1\" is a predefined property that describes the MIME type of an uploaded file and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_newp','s:181:\"\"$1\" is a predefined property that indicates whether a subject is new or not and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_num','s:189:\"\"$1\" is a [[Special:Types/Number|type]] and predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to represent numeric values.\";'),('en','messages:smw-pa-property-predefined_pdesc','s:194:\"\"$1\" is a predefined property that allows to describe a property in context of a language and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_pefu','s:178:\"\"$1\" is a predefined property provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki] to specify an external resource with a placeholder.\";'),('en','messages:smw-pa-property-predefined_peid','s:172:\"\"$1\" is a predefined property that specifies an external identifier and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_prec','s:172:\"\"$1\" is a predefined property that describes a [https://www.semantic-mediawiki.org/wiki/Help:Display_precision display precision] (in decimal digits) for numeric datatypes.\";'),('en','messages:smw-pa-property-predefined_pval','s:301:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value \"$1\"] is a predefined property that can define a list of permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Semantic MediaWiki].\";'),('en','messages:smw-pa-property-predefined_pvali','s:330:\"[https://www.semantic-mediawiki.org/wiki/Help:Special_property_Allows_value_list \"$1\"] is a predefined property that can specify a reference to a list that holds permissible values to restrict value assignments for a property and is provided by [https://www.semantic-mediawiki.org/wiki/Help:Special_properties Se