INSERT INTO `translate_sections` VALUES (9,'4','\'\'\'Das GeoPortal\'\'\'',1),(9,'5','In der Geodateninfrastruktur des Landes Rheinland-Pfalz übernimmt das GeoPortal.rlp die zentrale Aufgabe als serviceorientierte Vermittlungsstelle zwischen Nutzern und den Anbietern von Geodaten. Das GeoPortal.rlp schafft den Zugang zu den Geodaten über elektronische Netzwerke.',2),(9,'6','Das GeoPortal.rlp ging am 08.01.2007 erstmalig in Betrieb, am 18.02.2011 erfolgte ein Relaunch des Portals.',3),(9,'7','\"Geodaten suchen - Ergebnis wählen - Karte anzeigen\"',4),(9,'8','sind dabei die Kernfunktionalitäten für die Recherche und den Online-Zugriff auf verteilte Geodatenbestände sowie deren Visualisierung. Das Konzept der verteilten Datenhaltung raumbezogener Informationen, bei dem die Verantwortung für die Daten an der dafür zuständigen Stelle verbleibt, gewährleistet eine hohe Datenaktualität. Das sich bietende Angebot an Geodaten versetzt den Nutzer in die Lage, sein persönliches Geodatenprodukt individuell zusammenzustellen.',5),(9,'9','Die konsequente Nutzung anerkannter Standards der ISO (International Oganisation for Standardisation) und des OGC (Open Geospatial Consortium) im GeoPortal.rlp ermöglichen dabei einen unkomplizierten Datenaustausch.',6),(9,'Page display title','Das-Geoportal',0),(33,'1','\'\'\'Aktuelles\'\'\'\n26.11.2018',1),(33,'10','Hierzu werden den Kommunen, je nach den eigenen...',10),(33,'11','Lesen Sie weiter',11),(33,'12','25.09.2017',12),(33,'13','Bestellung eines neuen Vorsitzenden des Lenkungsausschusses für Geodateninfrastruktur Rheinland-Pfalz\nDer Lenkungsausschuss Geodateninfrastruktur Rheinland-Pfalz (LA GDI-RP) koordiniert den Aufbau und den Betrieb der Geodateninfrastruktur und des Geoportals Rheinland-Pfalz.Dessen langjähriger Vorsitzender Herr LMR Hans Gerd...',13),(33,'14','Lesen Sie weiter',14),(33,'15','25.09.2017',15),(33,'16','Vorträge der INSPIRE Konferenz 2017 online\nDie Vorträge der diesjährigen INSPIRE Konferenz sind seit Ende letzter Woche online zugänglich. Es wurden die Folien, wie auch die Videomitschnitte der jeweiligen Sessions...',16),(33,'17','Lesen Sie weiter',17),(33,'18','01.08.2017',18),(33,'19','Änderungen des BauGB §4a (4) Satz 1\nAus den Änderungen des BauGB §4a (4) Satz 1 resultiert Verpflichtung zur Internetveröffentlichung',19),(33,'2','Neuer Standard für Darstellungsdienste in Deutschland\nDas Lenkungsgremium GDI-DE hat auf der Herbstssitzung 2018 einen neuen Standard für die interoperable Bereitstellung von Darstellungsdiensten beschlossen.',2),(33,'20','Der neue § 4a Abs. 4 BauGB gibt vor, den Inhalt der ortsüblichen Bekanntmachung der Bauleitpläne und die auszulegenden...',20),(33,'21','Lesen Sie weiter',21),(33,'3','Das Dokument beinhaltet konkrete Vorgaben zur Bereitstellung von...',3),(33,'4','Lesen Sie weiter',4),(33,'5','28.03.2018',5),(33,'6','Neuer Kartenviewer für mobile Endgeräte\nDie Anwendung \"Geoportal Mobile\" wurde grundlegend überarbeitet und den Anforderungen der neueren Betriebssysteme mobiler Endgeräte (IOS/Android) angepasst. Der neue Client wurde von der Fima Netgis aus Trier im...',6),(33,'7','Lesen Sie weiter',7),(33,'8','15.11.2017',8),(33,'9','Offizieller Startschuss zur Bereitstellung der Offenlagen über das zentrale Internetportal des Landes\nIm GeoPortal.rlp stehen nun offiziell durch Beschluss des Lenkungsausschusses GDI-RP Wege zur Abbildung der Veröffentlichungspflichten aufgrund der Novelle des BauGB zur Verfügung.',9),(33,'Page display title','Meldungen',0),(62,'1','\'\'\'Letzte Änderungen\'\'\'',1),(62,'10','Unterm Bäumchen (66695)\nUnterm Bäumchen Bebauungsplan, Longkamp',10),(62,'2','Jockgrim (3605)\nBebauungspläne und Flächennutzungspläne von Jockgrim',2),(62,'3','Kartenserver aktualisiert Kartenserver aktualisiert\n24.01.2019',3),(62,'4','Wittlich (3432)\nBebauungspläne von Wittlich',4),(62,'5','Neuer Kartenserver Neuer Kartenserver\n21.01.2019',5),(62,'6','Longkamp (3805)\nBebauungspläne von Longkamp',6),(62,'7','Neuer Kartenlayer Neuer Kartenlayer\n21.01.2019',7),(62,'8','Umringe der Bebauungspläne von Longkamp (66696)\nUmringe aller Bebauungspläne von Longkamp',8),(62,'9','Neuer Kartenlayer Neuer Kartenlayer\n21.01.2019',9),(62,'Page display title','Letzte Änderungen',0),(81,'1','Hier finden Sie anleitungen',1),(81,'Page display title','Anleitungen',0),(88,'1','\'\'\'Motivation für eine Geodateninfrastruktur\'\'\'',1),(88,'2','In der sich herausformenden Wissensgesellschaft verändert die Informations- und Kommunikationstechnik unser Leben wie kaum eine andere Technologie. Die Gewinnung von Informationen aus multiplen Datenquellen und die Generierung von Wissen daraus sind zentrales Element der Gesellschaft geworden.',2),(88,'3','Damit wird der Zugang zu digitalen Daten und Informationen zu einem entscheidenden Standortfaktor und die Grundbedingung für die Entwicklung der Schlüsseltechnologien unserer Zeit. Bei der Modernisierung der Verwaltung und beim eGovernment spielen Geoinformationen zunehmend eine wichtige Rolle. Sie sind oft Grundlage für vielfältige Entscheidungen in Verwaltung, Wirtschaft, Politik oder im Alltag. Die Transparenz von Verwaltungsentscheidungen wird gesteigert und Bürgerbeteiligungen werden einfacher.',3),(88,'4','Eine zusätzliche und zudem externe Motivation besteht durch die externer LinkINSPIRE-Richtlinie, die den Auf- und Ausbau einer europaweiten Geodateninfrastruktur fordert. Hierbei soll die Effizienz und die Wertschöpfung vorhandener Datenbestände durch deren Harmonisierung und Integration gesteigert werden.',4),(88,'5','\'\'\'Aufgaben, Ziele und Bestandteile\'\'\'',5),(88,'6','Aufgabe und Ziel einer Geodateninfrastruktur ist es, über IT-Netze, Geodaten  schnell und einfach zu finden, zu visualisieren oder herunterladen zu können - z.B. über das Internet. Die Nutzung einer Geodateninfrastruktur erspart somit Wege und Zeit.',6),(88,'7','Eine Geodateninfrastruktur besteht inhaltlich insbesondere aus der Bereitstellung und Nutzung von Geobasisdaten, Geofachdaten und Geometadaten, die von den jeweils fachlich zuständigen Stellen digital als standardisierte GeoWebDienste über IT-Netze zur Verfügung gestellt werden. IT-Netzwerke sind Datenautobahnen bzw. bilden die physikalische Infrastruktur. Die Verwendung von Standards und Normen macht eine interoperable Nutzung von Geodaten bzw. einen verlustfreien Geodatenaustausch zwischen unterschiedlichen Systemen erst möglich. Für die Suche, Visualisierung und den Download von Geodaten werden GeoWebDienste verwendet bzw. benötigt.',7),(88,'Page display title','GDI und INSPIRE',0),(101,'1','\'\'\'Rechtliche Grundlage\'\'\'',1),(101,'10','externer LinkDurchführungsbestimmung zu Data Specs',10),(101,'11','PDF-DateiLGDIG - Landesgeodateninfrastrukturgesetz von Rheinland-Pfalz',11),(101,'12','PDF-DateiBegründung LGDIG - Begründung zum Landesgeodateninfrastrukturgesetz von Rheinland-Pfalz',12),(101,'13','PDF-DateiLGDIGDVO - Landesverordnung zur Durchführung des Landesgeodateninfrastrukturgesetzes  von Rheinland-Pfalz',13),(101,'14','PDF-DateiBegründung LGDIGDVO - Begründung zur Landesverordnung zur Durchführung des Landesgeodateninfrastrukturgesetzes von Rheinland-Pfalz',14),(101,'15','Weiterführende Informationen sowie die Gesetzestexte der anderen Bundesländer finden Sie auf der Homepage der externer LinkGDI-DE.',15),(101,'2','Um einen Überblick über die rechtliche Grundlage der GDI-RP zu geben, sind auf dieser Seite alle relevanten Gesetzestexte sowie Verordnungen aufgeführt.',2),(101,'3','externer LinkINSPIRE-Richtlinie  : Richtlinie 2007/2/EG des Europäischen Parlaments und des Rates zur Schaffung einer Geodateninfrastruktur in der Gemeinschaft',3),(101,'4','externer LinkEntscheidung der Kommission zur Durchführung der Richtlinie 2007/2/EG des Europäischen Parlaments und des Rates hinsichtlich Überwachung und Berichterstattung (pdf 06/09)\nDie \"Entscheidung der Kommission zur Durchführung der Richtlinie 2007/2/EG des Europäischen Parlaments und des Rates hinsichtlich Überwachung und Berichterstattung\" wurde am 11.06.2009 im EU-Amtsblatt veröffentlicht. Sie gilt ab dem 5. Juni 2009.',4),(101,'5','Die einzelnen Durchführungsbestimmungen der INSPIRE-Richtlinie finden Sie (mit ev. Änderungsfassungen) auf der Homepage der GDI-DE:',5),(101,'6','externer LinkDurchführungsbestimmung zu Metadaten',6),(101,'7','externer LinkDurchführungsbestimmung zu Network Services',7),(101,'8','externer LinkDurchführungsbestimmung zu Monitoring & Reporting',8),(101,'9','externer LinkDurchführungsbestimmung zu Data Sharing',9),(101,'Page display title','Rechtliche Grundlage',0),(122,'1','\'\'\'Links\'\'\'',1),(122,'2','Hier finden Sie ausgewählte Links rund um das Thema Geodaten:',2),(122,'3','[http://www.geoportal.rlp.de/portal/informationen/links/rheinland-pfalz.html Behörden und Einrichtungen in Rheinland-Pfalz]',3),(122,'4','Geoportale von Bund und Ländern',4),(122,'5','Behörden und Institutionen innerhalb Deutschlands',5),(122,'6','Behörden und Institutionen innerhalb Europas',6),(122,'Page display title','Links',0),(134,'1','\'\'\'Kontakt\'\'\'',1),(134,'2','Bei Fragen bezüglich einzelner Dienste, inhaltlich und technisch z.B. beim Ausfall des Dienstes, \nwenden Sie sich bitte an die in den Nutzungsbedingungen bzw. in den Metadaten jeweils aufgeführte Ansprechperson. \nWie Sie an diese Informationen kommen, lesen Sie hier.',2),(134,'3','Möchten Sie die Freischaltung auf einen kostenpflichtigen oder nutzerbeschränkten Dienst beantragen, füllen Sie das Onlineformular aus, welches erscheint, wenn Sie als angemeldeter Benutzer auf das Schlosssymbol mit dem Briefumschlag neben dem entsprechenden Titel klicken. Damit erreichen Sie den richtigen Ansprechpartner.',3),(134,'4','Bei Fragen und Problemen, die die Nutzung bzw. das Handling des GeoPortal.rlp betreffen, können Sie',4),(134,'5','unter externer LinkFAQ im Wiki des GeoPortal.rlp die am häufigsten gestellten Fragen nachlesen oder\neine E-Mail an E-Mailhelpdesk@vermkv.rlp.de schicken, die wir Ihnen schnellstmöglich beantworten werden,\noder sich telefonisch an einen unserer Mitarbeiter des Helpdesks wenden.',5),(134,'6','Helpdesk : 0261 / 492 300',6),(134,'7','Bei tiefergehenden, technischen Fragen schicken Sie bitte eine E-Mail an E-Mailkontakt@geoportal.rlp.de',7),(134,'Page display title','Kontakt',0);
